INSERT INTO `about_us` (`about_us_id`, `about_title`, `about_description`, `company_description`, `team_description`, `testimonial_description`, `about_image`) VALUES
(1, 'Our Story ', 'As we attempt to express our story, the time takes wings and flies to yesteryears. This Story is more humane than mundane , our story has a lot of history than simplified  glory…\r\n<br><br>Decades ago turns of events led to the mass exodus of Kashmiri Hindus to various parts of the Country , holding on to their pride possessions of values and knowledge.  As the local etymology goes, Kashmir is the land desiccated from  water; we again found ourselves  by the perennial banks of river  Narmada in Gujarat.  It may not be an exaggeration to say that nature comes naturally to us ..\r\n<br><br>Subsequently, adapting and fine tuning to the local life made us cognizant of numerous battles that the villagers fought every single day. We could empathize with their struggles against unemployment, prejudice and social stigma. A yearning to uplift and empower them socially and economically, and in doing so, forging our own identity, led to the conceptualizing of Octopus Care.<br><br><h1><b>A Beginning</b></h1><span>With three gritty\r\nwomen , having diverse corporate work experience, at the helm of Octopus Care,\r\nit was but natural that the challenge of women health and hygiene was taken\r\nhead on. Awareness drives about menstrual hygiene were held at personal and\r\ngroup levels in various neighboring villages. This drive was reinforced by\r\nintroducing Maitreya <span>- quality and\r\naffordable sanitary napkins, made readily available at their doorstep.<br><br></span></span><span>Nature bestows\r\nnumerous blessings on the villages, which Octopus Care endeavors to make\r\navailable to one and all. Mindful of sustainable development , at Octopus Care\r\n, we have a mission of syncing unlimited human capabilities with the bounties\r\nof mother nature and creating a high quality , world class natural skin and\r\nhair care product line which helps usher socioeconomic empowerment of the rural\r\nmasses.&nbsp; This also aims to strengthen the\r\nidea of Local to <span>Global.<br></span></span><br><span><b>Octopus\r\nCare</b> is an uplifting and\r\nexhilarating story of ordinary people whose resilience against odds fuels&nbsp; them to reach for newer milestones.</span><b></b>', 'To be a perennial source of employment for the Rural youth by channelizing their capabilities towards financial stability and self-reliance.\r\n', 'To manufacture finest range of natural skin and hair care products that consistently meet international standards in terms of quality and reliability.\r\n', 'To make available finest quality Natural Skin and Hair Care products to one and all, at pocket friendly prices.\r\n', 'Instagram Highlight Cover 1080x1920 px (2)-min.jpeg');
