INSERT INTO `blog` (`blog_id`, `blog_title`, `blog_short_description`, `blog_long_description`, `blog_image`) VALUES
(2, 'Myths & Facts about Facial Oils ', 'With high nutritive value, facial oils should be one of the most important product of skincare routine, yet they are disregarded because their role is not fully understood & there are many myths associated with them. \r\nLet us break down some common myths about Facial Oils', '<b>Facial Oils are not required if\r\nyou use a good moisturiser or cream </b>\r\n\r\n“Better together” is one of our\r\ncore beliefs, especially where skincare is concerned. This will allow your\r\nproducts to do their job better and reduce water from evaporating from your\r\nskin and also help hydrate dry, cracked skin for long time.<br><br><br><b>Facial Oils cause breakouts</b>\r\n\r\nHigh comedogenic value (high\r\nvalues means pore clogging) oils, mineral oils, synthetic oils can cause\r\nbreakouts. Naturally derived oils with antibacterial, anti-inflammatory properties\r\nare particularly good for skin-prone to breakouts. If you have acne-prone skin,\r\nthen consider Jojoba oil, which is believed to suppress chronic inflammation\r\nand itchiness.<br><br><br><b>Facial Oils should not be used by\r\noily skin types</b>\r\n\r\nIt seems illogical to spread more\r\noil on your skin when you battle with an overly oily complexion. But, using\r\ncertain types of facial oils can actually help regulate the problem. Jojoba Oil\r\n(Sheen Acne &amp; Pimple Facial Serum) can be used for regulating the amount of\r\nsebum the skin produces whilst also soothing inflammation.<br><br><br><b>Oil-free products are better for\r\nyour skin.</b>\r\n\r\nThere is an obsolete belief that\r\nin order for a product to be noncomedogenic (which do not clog pores), it must\r\nbe oil-free. Naturally derived oils with less comedogenic value can deeply\r\npenetrate the skin &amp; can-do wonders to the skin. You still need products\r\nwith some oil in them to properly hydrate and protect the skin.&nbsp;<br><br><br><b>Facial Oils are not an effective\r\nanti-ageing product</b>\r\n\r\nThe whole premise behind wrinkles\r\nis that dry &amp; dehydrated skin. Dehydrated skin will wrinkle up and show\r\nlines faster and deeper than hydrated skin. Oils, of course, stop dryness in\r\nits tracks and lock in moisture. For a youthful look, facial oils (like Sheen\r\nAnti-Aging Facial Serum) offer antioxidants, which are repairing, slow down\r\nageing and neutralise free radicals. Sea Buckthorn, Macademia, Camellia Oil for example help\r\nprovide powerful antioxidant protection from free radicals that may cause\r\ncellular damage.<br><br>', 'Untitled design (9).png');
INSERT INTO `cancellation_return_policy` (`cancellation_return_policy_id`, `cancellation_return_policy`) VALUES
(1, '<div><b>Cancellation and return policy</b></div><div>At Sheen, customer satisfaction is our only motto! We put all our sincere efforts&nbsp;to delight you with our products.</div><div>We hope that you never have to cancel or return a product. However if such situation arises, we are always there to help you in best possible manner. Please read below our cancellation and return policy to take care of your hassles.<br><br></div><div><b>Order has not been shipped yet</b>: Any order which has not been shipped can be cancelled and refunded. Cancellation has to be done on the same day when the order is placed.<br><br></div><div><b>Unopened and Sealed Products:</b> We offer 7 days Return Guarantee from the date of delivery of all products shipped, provided they are unused, packed and sealed in the same condition as received. However, postage will be borne by the customer. After receiving back the products in good conditions, please allow one to three weeks from the day you return your package for your request to be processed. You will be contacted once your return is complete.<br><br></div><div><b>Order was damaged when received:</b> We take utmost care while packaging to ensure that the product reaches you in perfect condition. However, due to situations beyond our control, the items delivered might get damaged in transit. We would be more than happy to replace your order under such circumstance. We would request you to let us know of the damage along with images/videos so that we can make sure the same is not repeated with any other customer. The replacement product will be sent to you once we get back the original product&nbsp;</div><div><br></div><div><b>Refunds:</b></div><div>In case of refunds, the amount paid by you will get refunded using mode of payment within 5-7 days. If refund via payment gateway is not possible, our customer team will contact you to share NEFT / RTGS / UPI details in order to transfer the money.</div><div><br></div><h1></h1>');
