INSERT INTO `medical_disclalmer` (`medical_disclalmer_id`, `medical_disclalmer`) VALUES
(1, '<div><b>MEDICAL DISCLAIMER</b></div><div>Pure Essential Oils and other natural ingredients have been used for centuries in Skincare and Haircare products. We believe that natural products are healthier and gentler on the skin and all have their unique fruitful and remedial properties.<br><br></div><div><b>However, we must make this disclaimer:</b></div><div>While many of the natural ingredients in our products are believed to have therapeutic and healing properties, they are not to be used to treat any form of health problem. We do not recommend the use of these products as an alternate for medical care.&nbsp;Octopus Care (Sheen Care)&nbsp;is not responsible for any individual reaction to any particular ingredient. We maintain a transparent policy, where each product description on our website includes a complete list of ingredients. People with sensitivities to any listed ingredient should not use the product. We recommend to always do a patch test to ensure the suitability of the product.</div><div>Please do not use the information found within this website to self-diagnose any medical conditions or treat any health problems or diseases. Please consult your doctor, should you have any concerns that require medical attention.</div><div>This information is for educational purposes only and is not intended to diagnose, treat, cure, or prevent any disease.</div><div><br></div><h1></h1>');
