INSERT INTO `payment_policy` (`payment_policy_id`, `payment_policy`) VALUES
(1, '<div><b>Payment Security</b></div><div>All transactions at Sheencare Online are protected by SSL (Secure Sockets Layer) and Secure Data Encryption using a 1024-bit process. Any information you enter when transacting with Sheencare Online is sent in a Secure Socket Layer (SSL) session and is encrypted to protect you against unintentional disclosure to third parties. This is an assurance that we follow the best security practices adopted by major online vendor, where all payments are processed in real-time, for your security and immediate peace of mind.</div><div><br></div><div><b>Pricing Policy</b></div><div>The product prices listed are current and updated. However, these are subject to change without advance notice. All prices on this web site are processed in Indian Rupees and the prices are inclusive of all taxes.</div><div>Our products are liable for GST in India.</div><div><br></div><div><b>Cash on Delivery Policy</b></div><div>We have the option for Cash on Delivery for all order values, but all COD orders will be charged flat INR 75/- per order.&nbsp;</div><div>If a ‘COD’ order is returned to us due to your unavailability or any other reason, we will only reship the same order only if you convert it to a prepaid order, post-delivery failure.</div><h1></h1>');
INSERT INTO `privacy_policy` (`privacy_policy_id`, `privacy_policy`) VALUES
(3, '<div><b>PRIVACY POLICY</b></div><div><b><br></b></div><div>The privacy policy outlines how \"SheenCare\" uses and protects any information provided by users on its website.</div><div>We insists upon the highest standards for secure transactions and protection of your Personal Information and its privacy. We are committed to protecting and safeguarding your privacy&nbsp;</div><div><b>Note </b>: Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.</div><div>Collection of Personally Identifiable Information and other Information</div><div>We collect information as furnished to us and/or collected that is necessary and relevant for providing our core services and products. This information may include your name, address, telephone number, date of birth, email address, descriptions of the items requested or purchased, language preference, the IP address and operating system of your computer, the browser type and version being used by you. This information may be stored on our computer records system and/or in printed records (collectively, information). We collect information in various ways, such as over the phone or in writing, in person, or over the Internet.&nbsp;</div><div>We collect information in order to ensure accurate service. Most of the information we collect is very basic and is needed to complete a purchase or provide a refund. We will not sell, distribute or lease your personal information to third parties.<br><br></div><div><b>Information Use &amp; Sharing</b><br><br></div><div>We use personal information to provide the services you request. We require this information primarily to provide better service by understanding your needs along with the following reasons:</div><div>•	Internal record keeping</div><div>•	Improvement of our products and services</div><div>•	Marketing purposes to send periodically promotional emails about new products, special offers or other information of interest to you. We may contact you by email or phone for the same.<br><br></div><div>We will treat your personal information as strictly private and confidential. We will only use or disclose it for purposes directly related to our core business, or in ways that you would reasonably expect that we may use it in the course of our business. We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential and the data is used only for the activities we have asked them to perform.&nbsp;</div><div><b><br></b></div><div><b>COOKIES</b><br><br></div><div>A cookie is a small file which asks permission to be placed on your computers hard drive. You can choose to accept or decline cookies. The Website uses temporary cookies to store certain data (that is not sensitive personal data or information) that is used by us and our service providers for the technical administration of the Website, research and development, and for administration. In the course of serving advertisements or optimizing services to you, we may allow authorized third parties to place or recognize a unique cookie on your browser. We do not store personally identifiable information in the cookies.</div><div><b><br></b></div><div><b>Links to Other Sites</b><br><br></div><div>Occasionally, we may make available a link to a third party web site. These links will let you leave the portal. The linked sites are not under our control and we are not responsible for the privacy practices or the contents of any linked site or any link contained in a linked site, or any changes or updates to such sites. We are not responsible for webcasting or any other form of transmission received from any linked site. We provide the links to you only as a convenience. We do not endorse the site or its use or contents.</div><div><b><br></b></div><div><b>Policy Change</b><br><br></div><div>Our Privacy Policy may change from time to time. We will not reduce your rights under this Privacy Policy without your explicit consent. We will post any privacy policy changes on this page and, if the changes are significant, we will provide a more prominent notice (including, for certain services, email notification of privacy policy changes).</div><div><br></div>');
INSERT INTO `product` (`pro_id`, `root_category_id`, `sub_category_id`, `child_category_id`, `pro_name`, `pro_short_description`, `pro_long_description`, `ingredients`, `key_benefits`, `product_profile`, `directions_to_use`, `certifications`, `general_info`, `price`, `offer_price`, `weight`, `attribute`, `offer_status`, `pro_image`, `pro_image2`, `product_rating`, `total_rating`, `single_image1`, `single_image2`, `single_image3`, `single_image4`, `hot_deal`, `iconimage`) VALUES
(71, 7, 45, 36, 'Chocolate Pie Lip Care', '<b>Let The Chocolaty Secrets Tantalise Your Lips</b>', 'Sheen Lip Care is perfect mixture of nutrient rich natural Butters and Oils that keep your Lips Soft, Nourished and Glowing all day long. No need to worry about harsh chemicals.<br>', '<div><span><b>Organic Beeswax</b><span><br>Beeswax hydrates, conditions, soothes, and calms the lip skin. Without clogging the pores, Beeswax creates a hydrating, long-lasting protective barrier to protect Lips against harsh environment. Its exfoliating and reparative properties combined with its Vitamin content helps promote the skin’s regeneration.</span></span>&nbsp;&nbsp;<br><span><span><br><b>Cocoa Butter</b></span><span><br>Cocoa butter is an emollient that is a great source of natural antioxidants. It adds a protective hydrating layer to lips, helping protect them from extreme temperatures and indoor heat that can leave your lips dried out.</span></span><br><span><span><br><b>Almond Oil</b></span><span><br>Almond oil soothes and moisturizes your lips. It lightens dark lips, removes dark spots and tries to even the lip colour. Almond Oil helps to rejuvenate your lips by removing the dead skin cells, prevent chapped lips.&nbsp;Vitamin E&nbsp;present in Almond Oil helps to keep your lips healthy and nourished.</span></span><br><span><br><b>Coconut Oil</b></span><span><br>Coconut oil benefits include the potential disinfecting and antimicrobial properties. Such benefits keep your lips germ-free, and subsequently help protect any cracked skin from becoming infected too. It has restorative and protective properties that&nbsp;help repair dry and cracked lips.<br></span><br><span><b>Vitamin E Oil</b><br></span>A must for healthy skin, its antioxidant nature gives extra protection against oxidative stress&nbsp;and lightens dark spots.<br><br></div>', '<div>Nourishes and moisturises dry lips.<br><span><br>Fades pigmentation.<br></span><span><br>Protects sensitive lips from harsh weather.<br></span><span><br>Heals painful, chapped lips.<br></span><span><br>Provides protective barrier for new skin cells.&nbsp;<br></span><span><br>With a Hint of colour, for youthful supple lips.</span><br></div>', '<span>All the oils used are 100% Natural &amp; Cold Pressed<br><br></span><span>No Preservatives used<br><br></span>Paraben free<br>', 'Gently apply to Lips using your finger tip to have even colour.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', '<div>Chocolate Pie Lip Care is suitable for:&nbsp;</div><div><br></div><div>Skin type - All</div><div>Gender - Female<br><br><div><span><b>Expecting and Breastfeeding mothers</b> -\r\nPlease always check with your Doctor prior to use.<br><br></span>\r\n\r\n<div>PATCH TEST is advisable before adding a new product to\r\nyour routine. Apply the product to your hand (back side) and observe for the\r\nsometime. <br>If there’s no reaction, you can apply the product to your Lips.\r\nKindly ensure you are not allergic to any ingredient used in this product.&nbsp;<br></div></div></div>', 70, 65, '', '6 gm', 1, 'Chocolate Sticker-min.jpg', 'Chocolate Outer-min.jpg', 5, '5', 'Chocolate Sticker-min.jpg', 'Chocolate Outer-min.jpg', 'Chocolate-min.jpg', '', 1, '1'),
(72, 7, 45, 35, 'Vanilla Creamsicle Lip Care', '<b>Let Vanilla Caress and Cool Your Lips</b>', 'Sheen Lip Care is perfect mixture of nutrient rich natural Butters and Oils that keep your Lips Soft, Nourished and Glowing all day long. No need to worry about harsh chemicals.<br>', '<div><span><b>Organic Beeswax</b><span><br>Beeswax hydrates, conditions, soothes, and calms the lip skin. Without clogging the pores, Beeswax creates a hydrating, long-lasting protective barrier to protect Lips against harsh environment. Its exfoliating and reparative properties combined with its Vitamin content helps promote the skin’s regeneration.</span></span>&nbsp;&nbsp;<br><span><span><br><b>Cocoa Butter</b></span><span><br>Cocoa butter is an emollient that is a great source of natural antioxidants. It adds a protective hydrating layer to lips, helping protect them from extreme temperatures and indoor heat that can leave your lips dried out.</span></span><br><span><span><br><b>Almond Oil</b></span><span><br>Almond oil soothes and moisturizes your lips. It lightens dark lips, removes dark spots and tries to even the lip colour. Almond Oil helps to rejuvenate your lips by removing the dead skin cells, prevent chapped lips.&nbsp;Vitamin E&nbsp;present in Almond Oil helps to keep your lips healthy and nourished.</span></span><br><span><br><b>Coconut Oil</b></span><span><br>Coconut oil benefits include the potential disinfecting and antimicrobial properties. Such benefits keep your lips germ-free, and subsequently help protect any cracked skin from becoming infected too. It has restorative and protective properties that&nbsp;help repair dry and cracked lips.<br></span><br><span><b>Vitamin E Oil</b><br></span>A must for healthy skin, its antioxidant nature gives extra protection against oxidative stress&nbsp;and lightens dark spots.<br></div>', '<div><div><div>Nourishes and moisturises dry lips.<br><span><br>Fades pigmentation.<br></span><span><br>Protects sensitive lips from harsh weather.<br></span><span><br>Heals painful, chapped lips.<br></span><span><br>Provides protective barrier for new skin cells.&nbsp;<br></span><span><br>With a Hint of colour, for youthful supple lips.</span><br></div></div></div>', '<blockquote></blockquote><span>All the oils used are 100% Natural &amp; Cold Pressed<br><br></span><span>No Preservatives used<br><br></span>Paraben free&nbsp;', 'Gently apply to Lips using your finger tip to have even spread.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', '<div>Vanilla Creamsicle Lip Care is suitable for:&nbsp;</div><div><br></div><div>Skin type - All</div><div>Gender - Unisex product<br><br><div><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine. Apply the product to your hand (back side) and observe for the sometime. <br>If there’s no reaction, you can apply the product to your Lips. Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div></div><div><br></div><div><br></div><div><br></div>', 70, 65, '', '6 gm', 1, 'Vanilla Sticker-min.jpg', 'Vanilla Outer-min.jpg', 5, '5', 'Vanilla Sticker-min.jpg', 'Vanilla Outer-min.jpg', 'Vanilla-min.jpg', '', 1, '1'),
(73, 7, 45, 38, 'What-a-Melon Lip Care', '<b>Let Your Lips Dabble In Water Melony Delight</b>', '<span>Sheen Lip Care is perfect mixture of\r\nnutrient rich natural Butters and Oils that keep your Lips Soft, Nourished and\r\nGlowing all day long. No need to worry about harsh chemicals.<b></b></span>', '<div><span><b>Organic Beeswax</b><span><br>\r\nBeeswax hydrates, conditions, soothes, and calms the lip skin. Without clogging\r\nthe pores, Beeswax creates a hydrating, long-lasting protective barrier to\r\nprotect Lips against harsh environment. Its exfoliating and reparative\r\nproperties combined with its Vitamin content helps promote the skin’s\r\nregeneration.</span></span>\r\n\r\n&nbsp;\r\n\r\n<br><span><b><br>Cocoa Butter</b><span><br>\r\nCocoa butter is an emollient that is a great source of natural antioxidants. It\r\nadds a protective hydrating layer to lips, helping protect them from extreme\r\ntemperatures and indoor heat that can leave your lips dried out.</span></span>\r\n\r\n<br><span><b><br>Almond Oil</b><span><br>\r\nAlmond oil soothes and moisturizes your lips. It lightens dark lips, removes\r\ndark spots and tries to even the lip colour. Almond Oil helps to rejuvenate\r\nyour lips by removing the dead skin cells, prevent chapped lips.&nbsp;Vitamin\r\nE&nbsp;present in Almond Oil helps to keep your lips healthy and nourished.</span></span><br><b><br>Coconut\r\nOil</b><span><br>\r\nCoconut oil benefits include the potential disinfecting and antimicrobial\r\nproperties. Such benefits keep your lips germ-free, and subsequently help\r\nprotect any cracked skin from becoming infected too. It has restorative and\r\nprotective properties that&nbsp;help repair dry and cracked lips.<br></span><br><b>Vitamin E Oil<br></b>A must for healthy skin, its antioxidant nature gives extra protection against oxidative stress&nbsp;and lightens dark spots.<b><br></b></div>', '<div>Nourishes and moisturises dry\r\nlips.<br>\r\n\r\n<span><br>\r\nFades pigmentation.<br></span>\r\n\r\n<span><br>\r\nProtects sensitive lips from harsh weather.<br></span>\r\n\r\n<span><br>\r\nHeals painful, chapped lips.<br></span>\r\n\r\n<span><br>\r\nProvides protective barrier for new skin cells.&nbsp;<br></span>\r\n\r\n<span><br>\r\nWith a Hint of colour, for youthful supple lips.</span></div>', '<span>All the oils used are 100% Natural &amp; Cold Pressed<br><br></span><span>No Preservatives used<br><br></span>Paraben free<br><br>&nbsp;', 'Gently apply to Lips using your finger tip to have even colour.', 'FDCA Licensed Manufacturer 	<br><br>		ISO 9001-2019 certified 	<br><br>		GMP certified<br>', '<div>What-a-Melon Lip Care is suitable for:&nbsp;</div><div><br></div><div>Skin type - All</div><div>Gender - Female</div><div><br></div><div><div><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine. Apply the product to your hand (back side) and observe for the sometime. <br>If there’s no reaction, you can apply the product to your Lips. Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div></div>', 70, 65, '', '6 gm', 1, 'Watermelon Sticker-min.jpg', 'Watermelon Outer-min.jpg', 5, '5', 'Watermelon Sticker-min.jpg', 'Watermelon Outer-min.jpg', 'Watermelon-min.jpg', '', 1, '1'),
(74, 7, 45, 37, 'Fruit Brust Lip Care', '<b>Feel The Freshness Of Fruits Tingle Your Lips</b>', 'Sheen Lip Care is perfect mixture of nutrient rich natural Butters and Oils that keep your Lips Soft, Nourished and Glowing all day long. No need to worry about harsh chemicals.', '<div><span><b>Organic Beeswax</b><span><br>Beeswax hydrates, conditions, soothes, and calms the lip skin. Without clogging the pores, Beeswax creates a hydrating, long-lasting protective barrier to protect Lips against harsh environment. Its exfoliating and reparative properties combined with its Vitamin content helps promote the skin’s regeneration.</span></span>&nbsp;&nbsp;<br><span><span><br><b>Cocoa Butter</b></span><span><br>Cocoa butter is an emollient that is a great source of natural antioxidants. It adds a protective hydrating layer to lips, helping protect them from extreme temperatures and indoor heat that can leave your lips dried out.</span></span><br><span><span><br><b>Almond Oil</b></span><span><br>Almond oil soothes and moisturizes your lips. It lightens dark lips, removes dark spots and tries to even the lip colour. Almond Oil helps to rejuvenate your lips by removing the dead skin cells, prevent chapped lips.&nbsp;Vitamin E&nbsp;present in Almond Oil helps to keep your lips healthy and nourished.</span></span><br><span><br><b>Coconut Oil</b></span><span><br>Coconut oil benefits include the potential disinfecting and antimicrobial properties. Such benefits keep your lips germ-free, and subsequently help protect any cracked skin from becoming infected too. It has restorative and protective properties that&nbsp;help repair dry and cracked lips.<br></span><br><span><b>Vitamin E Oil</b><br></span>A must for healthy skin, its antioxidant nature gives extra protection against oxidative stress&nbsp;and lightens dark spots.<br></div>', '<div>Nourishes and moisturises dry lips.<br><span><br>Fades pigmentation.<br></span><span><br>Protects sensitive lips from harsh weather.<br></span><span><br>Heals painful, chapped lips.<br></span><span><br>Provides protective barrier for new skin cells.&nbsp;<br></span><span><br>With a Hint of colour, for youthful supple lips.</span><br></div>', '<span>All the oils used are 100% Natural &amp; Cold Pressed<br><br></span><span>No Preservatives used<br><br></span>Paraben free<br>', 'Gently apply to Lips using your finger tip to have even colour.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified', '<div>Fruit Burst Lip Care is suitable for:&nbsp;</div><div><br></div><div>Skin type - All</div><div>Gender - Female</div><div><br></div><div><b>Expecting and Breastfeeding mothers</b> - Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine. Apply the product to your hand (back side) and observe for the sometime. <br>If there’s no reaction, you can apply the product to your Lips. Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div>', 70, 65, '', '6 gm', 1, 'Mix Fruit Sticker-min.jpg', 'Mix Fruit outer-min.jpg', 5, '5', 'Mix Fruit Sticker-min.jpg', 'Mix Fruit outer-min.jpg', 'Mix Fruit-min.jpg', '', 1, '1'),
(75, 7, 44, 39, 'Lightening & Brightening Face Cream ', '<b>With Rosehip Oil, Ginseng &amp; Licorice Extract</b>', 'Enriching mix of the skin nourishing\r\nnutrients,&nbsp;antioxidants, healthy fats and more. Sheen Lightening &amp;&nbsp;Brightening cream, is your answer to all skin woes like dark spots, skin pigmentation and uneven skin tone.', '<div><span><b>Licorice Extract<br></b>Treats hyperpigmentation, makes skin bright,&nbsp;even toned and&nbsp;blemish free.</span><span>&nbsp;<br></span><span><b><br>Rosehip Oil</b><span><br>\r\nAddresses scars, pigmentation and wrinkles. Exfoliates,&nbsp;repairs\r\ndamaged skin caused by free radicals and tightens pores giving flawless and firm skin.\r\nIt is rich in Vitamin A, Vitamin C and Essential&nbsp;fatty acids.<br></span></span><span><b><br>Ginseng Extract<br></b>Boosts skin health by improving blood circulation and collagen synthesis. It balances oil production for acne control and treats hyper pigmentation and dull skin.&nbsp;<br></span><br><span><b>Niacinamide (Vitamin B3)</b><br>Also called Niacin, it has excellent anti-inflammatory and anti-oxidant properties. The skin restoring, Niacinamide&nbsp;helps combat environmental stress leading to premature ageing. It gives even tone, fills fine lines, and restores lustre and health of sensitive skin. Reduces blotchiness and&nbsp;pigmentation. Production of ceramide strengthens the epidermal barrier, preventing water loss.</span>&nbsp;&nbsp;<br><b><span><br>Mango Butter<br></span></b>With its non-comedogenic\r\nproperties, Mango Butter is suitable for all skin types. It gives intense\r\nmoisturisation&nbsp;to the dry itchy skin. Anti-inflammatory and anti-oxidant\r\nin nature, it protects from environmental damages that cause lines\r\nand&nbsp;wrinkles, reduces acne scars and stretch marks. Excellent defoliant,\r\nhelps in cleansing by softening the keratin, boosts collagen and firms up the\r\nskin.&nbsp;&nbsp;&nbsp;&nbsp;\r\n\r\n<br><span><b><span><br>Olive Oil<br>\r\n</span></b>Anti-oxidant and anti-bacterial\r\nproperties make Olive Oil fight premature ageing, help fade scars, and reduce\r\npigmentation. Olive Oil contains Vitamins E and K, Calcium, Potassium, Polyphenols,\r\nOleocanthal, Tocopherols, Phytosterols, Squalene.</span>\r\n\r\n&nbsp;\r\n\r\n<br><span><b><span><br>Almond Oil<br>\r\n</span></b>This anti-inflammatory,\r\nnutritional powerhouse contains phytochemicals and healthy fats which repair\r\nthe damaged dry skin, removes puffiness and dark circles, and improves skin\r\ntone and complexion. Contains vitamin D, A, E; Omega 3 fatty acid; Proteins,\r\nMinerals like Zinc,&nbsp;Copper, Magnesium, Phosphorus and Potassium.</span>\r\n\r\n&nbsp;\r\n\r\n<br><span><b><span><br>Vitamin E<br>\r\n</span></b>A must for healthy skin, its anti-oxidant nature gives extra protection against oxidative stress, reverses signs of\r\nageing, enhances collagen production, deep cleanses and&nbsp;lightens dark\r\nspots.<br></span><b><br></b><span><b>Grapefruit Essential Oil<br>\r\n</b>Grapefruit Essential Oil helps fight bacteria and greasiness that can cause\r\nacne blemishes. It may also be useful for keeping your skin’s immunity strong\r\nagainst indoor and outdoor air pollution.</span><br><b><br>Lavender\r\nEssential Oil</b><span><br>\r\nLavender Essential Oil works to kill bacteria, and this can prevent and heal\r\nacne breakouts. It unclogs pores and reduces inflammation when you put it on your\r\nskin. Lavender Oil has antifungal properties and reduces inflammation, it can help\r\nkeep eczema at bay. Lavender Oil helps cleanse your skin and lessen redness and irritation.<br></span><br><b>Glycerin</b><span><br>Glycerin is great for the skin because it acts as a humectant, a substance that allows the skin to retain moisture. It can increase skin hydration, relieve dryness, and refresh the skins surface.</span><br></div>', 'Restores skin health by intensive nourishing.<br><br>Lightens dark spots, acne&nbsp;scars and hyperpigmentation.<br><br>Reverses signs of ageing&nbsp;by enhanced collagen\r\n     production.<br><br>Makes the skin even toned, soft, supple and radiant.<br><br>Helps combat adverse effects of environmental\r\n     pollutants on the skin.<br>&nbsp; &nbsp;<br>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>Paraben free<br><br><span>Aroma derived from natural ingredients without any added or synthetic fragrances<br>&nbsp;<br></span>98% Natural ingredients used', 'After cleansing &amp; toning, take small amount of face cream &amp;\r\nmassage gently using fingertips in circular motion till it gets absorbed completely. <br><br>For best results use Sheen Brightening &amp;&nbsp;Lightening&nbsp;Facial Serum at Night.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified', '<div>Lightening &amp;&nbsp;Brightening Face Cream is suitable for:&nbsp;</div><div><br></div><div>Skin type - All&nbsp;</div><div>Gender - Unisex product<br><br></div><div><b>Expecting and Breastfeeding mothers</b> - Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine.&nbsp;</div><div>Apply the product on your inner elbow / jawline and observe for the next 24 hours.&nbsp;</div><div>If there’s no reaction, you can apply the product on your face.&nbsp;</div><div>If skin is sensitive, continue the test for 7 days.&nbsp;Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div><div>If irritation occurs, please discontinue the product and consult a dermatologist.</div>', 165, 155, '', '50 gm', 1, 'Face cream Front-min.jpg', 'face cream outer-min.jpg', 5, '5', 'Face cream Front-min.jpg', 'face cream outer-min.jpg', 'Mockup 5 cream Jar-min.jpg', 'Face Cream Cream-min.jpg', 1, '1'),
(77, 7, 43, 31, 'Nourishing Facial Serum  ', '<b>With Goodness Of Sandalwood Essential Oil &amp; Sea Buckthorn Extract</b><br>', 'Skin is the largest organ in the body &amp; serves as a protective barrier to help prevent harmful substances from entering the body. Damaging sun rays, chemicals, pollution and smoke all can affect the skin. Therefore, if we really want to protect our bodies, we need to commit to protecting our skin and making it a powerful barrier. Sheen Nourishing Facial Serum does that for you by replacing dry, flaky, itchy, tired and sun damaged skin with nourished, hydrated, glowing and supple skin by the virtue of its age-old, proven, nutrient rich 100% natural oils.', '<div><b>Sea Buckthorn Extract</b><br>Sea Buckthorn Extract&nbsp;is known for its healing\r\nbenefits, skin hydration, and production of more collagen that helps to plump\r\nyour skin.&nbsp;The Vitamin C content in the Sea Buckthorn alone will blow your\r\nmind away as it contains about 12 times more than that of an orange fruit. Sea\r\nBuckthorn comes jam packed with potent antioxidants and minerals, and Vitamins\r\nB1, B2, K, C, A and E. It is believed to hold three times more Vitamin A than\r\ncarrots and a considerable amount of Vitamin E.<br><b><br>Sandalwood Oil</b><br>Antiseptic, antioxidant and antimicrobial in nature, Sandalwood Oil prevents premature skin ageing like blemishes, lines, wrinkles and sagging; helps reduce acne breakouts. It hydrates and cleanses skin and is also used&nbsp;in aromatherapy. Contains alpha Santalol, Beta-Santalol, Oxygenated Terpene Santalol, Alpha Bergamotol, Farsenol.<br><b><br>Almond Oil</b>	<br>This anti-inflammatory, nutritional powerhouse contains phytochemicals and healthy fats which repair the damaged dry skin, removes puffiness and dark circles. It improves skin tone and complexion. Contains Vitamin D, A, E; Omega 3 fatty acid; proteins and minerals like Zinc, Copper, Magnesium, Phosphorus and Potassium.<br></div><div><br></div><div><b>Olive Oil</b>	<br>Anti-oxidant and anti-bacterial properties make Olive Oil fight premature ageing, help fade scars, and reduce pigmentation. Olive Oil contains Vitamins E and K, Calcium, Potassium, Polyphenols, Oleocanthal, Tocopherols, Phytosterols, Squalene.&nbsp;<br></div><div><br></div><div><b>Wheatgerm Oil</b>	<br>Wheatgerm Oil is considered to\r\nbe good solution for skins health. Stuffed with worthwhile antioxidants, it\r\nviably treats dryness, skin inflammation, dark spots, and scars. Wheatgerm Oil\r\nis an incredibly healthy oil that has Vitamin E that helps battle against free\r\nradicals. Wheatgerm oil is said to be a powerful antioxidant. Wheat germ is\r\nknown for at least 23 odd nutrients, including Vitamins A, B, D and E.</div><div><br></div><div><b>Apricot Kernel Oil</b>	<br>Apricot Kernel Oil helps to improve skin tone,\r\nmaintain softness and radiance of the skin. It also nourishes the skin and\r\nlowers the appearance of face wrinkles, fine lines and blemishes. As per\r\nAyurveda, its Vata balancing properties make it nourishing in nature. These\r\nproperties also make it a great age defying ingredient to prevent fine lines\r\nand wrinkles. Apricot Kernel Oil is also naturally high in Vitamin E &amp; C.\r\nIt is also rich in Vitamin A which makes skin soft and smooth.<br></div><div><span><br><b>Coconut Oil<br></b></span>It has as antioxidant, anti-bacterial, anti-fungal,\r\nanti-inflammatory&nbsp;properties. Enhances collagen production, makes skin\r\nfirm, even toned. Traps moisture and soothes irritated, dry, chapped skin. It\r\nis rich in Oleic acid, Lauric acid, Caprylic acid, and Palmitic acid.<span><br><br></span></div><div><b>Avocado Oil</b><br>Acts as a non-greasy, easily\r\nabsorbed sun block that soothes itchy and chapped skin. Replenishes dry and\r\ndamaged skin by moisturising and increased collagen production. Contains\r\nVitamins A, D, E; Proteins, Lecithin; Fatty acids like Linoleic acid and Oleic\r\nacid.</div><div><br></div><div><b>Borage Oil</b><br>Non greasy Borage Oil is anti-inflammatory and anti-oxidant,\r\nhas high GLA content essential to combat oxidative cell damage. Reduces dryness\r\nand boosts cell regeneration. Contains Vitamin A, B, C, Niacin, Thiamine,\r\nseveral minerals and Gamma Linoleic Acid.<br></div><div><br></div><div><b>Vitamin E Oil</b>	<br>A must for healthy skin, its antioxidant nature gives extra protection against oxidative stress, reverses signs of ageing, enhances collagen production, deep cleanses, and lightens dark spots.<br></div><div><br></div><div><b>Lavender Oil</b>	<br>Lavender Oil works to kill bacteria, and this can\r\nprevent and heal acne breakouts. It unclogs pores and reduces inflammation when\r\nyou put it on your skin. The Lavender oil helps cleanse your skin and lessen\r\nredness and irritation. Lavender oil aids in skin lightening since it reduces\r\ninflammation. It also reduces discoloration and dark spots.&nbsp;<br></div><div><br></div><div><br></div><div><br></div><div><br></div>', 'Deep nourishes dull and calloused skin.<br><div><br>Reverses the oxidative cell damage by rejuvenating the structural integrity of the skin.</div><div><br>Reduces rashes and irritations by moisturising and hydrating the skin.</div><div><br>Increases elasticity and collagen metabolism.</div>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>No Preservatives used<br><br>Paraben free<br><br>100% Natural Product<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances<br>', 'Cleanse your face. Apply 2-3 drops of Facial Oil followed by gentle fingertip massage before sleeping.<br><br><div>For best results apply daily &amp; cleanse with&nbsp;Sheen Vitamin E Soap.<br></div>', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified', '<div>Nourishing Facial Serum is suitable for:&nbsp;</div><div><br></div><div>Skin type - Normal to Dry</div><div>Gender - Unisex product</div><div><br></div><div><span><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product on your face.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product. <br>If irritation occurs, please discontinue the product and consult a dermatologist.<br></div>', 150, 140, '', '10 ml', 1, 'Niurishing Front-min.jpg', 'Niurishing-min.jpg', 5, '5', 'Niurishing Front-min.jpg', 'Niurishing-min.jpg', 'Niurishing Box-min.jpg', 'WhatsApp Image 2021-06-25 at 16.30.52.jpeg', 1, '1'),
(80, 8, 48, 46, 'Anti Dandruff Hair Oil', '<b>With Goodness Of Argan &amp; Tea Tree Essential Oil</b>', 'Perfect blend of 100% Natural Cold Pressed Oil.&nbsp;Sheen Anti Dandruff Hair Oil is perfect mixture of nutrient rich oils that have antifungal, antioxidant and anti-inflammatory properties. This oil reduces the itchiness, greasiness, and lesions associated with&nbsp;dandruff.', '<b>Argan Oil <br></b>It has anti-inflammatory and antioxidant properties that are good for the hair.&nbsp;Argan oil helps to reduce inflammation and can relieve dandruff-inducing oxidative stress. It is also used as a treatment for flaky scalp and scalp psoriasis.&nbsp;Argan oil&nbsp;helps prevent or improve skin conditions, that affect the scalp and can cause dandruff and hair loss.&nbsp;<br><br><b>Tea Tree Oil</b><br>It help reduce the itchiness, greasiness, and lesions associated with dandruff. Dandruff is caused by an overgrowth of yeast, so Tea Tree oils antifungal properties are great for treating it.<br><b><br>Almond Oil <br></b>It is an emollient, meaning it can fill in gaps in your hair at a cellular level. That makes your hair feel smoother to the touch. Almond oil helps in softening dandruff which loosens its hold on the scalp and can be easily cleaned out when shampooing after the oiling.\r\n<br><b><br>Sunflower Oil <br></b>It contains Oleic acid, which can stop hair breakage. It has anti-inflammatory properties which may help calm dandruff and relieve an itchy scalp. <br><br><b>Coconut Oil</b> <br>It helps slow down hair loss by penetrating deep into your hair shaft to prevent protein loss, which in turn prevents breakage.  When applied to your scalp, it simultaneously moisturizes and removes build-up around your hair follicles to jumpstart hair growth.<br><b><br>Castor Oil</b> <br><span>It is rich in Ricinoleic acid - a type of fatty acid found to fight inflammation. When applied to the scalp, it is purported to enhance the health of the hair follicles and, in turn, promote hair growth (as well as protect against hair loss).<br></span><b><br>Vitamin E Oil</b><br><span>It stimulates the capillaries, thereby increasing blood flow to the scalp and encouraging hair growth. Vitamin E addresses the concerns of brittle, dehydrated and premature ageing hair by extra protection against oxidative stress caused by environmental pollutants and other styling processes.<br></span><b><br>Peppermint Oil <br></b>It helps in reducing dryness, itching, or other scalp problems. Peppermint Essential Oil is a vasodilator meaning it helps in improving blood flow in scalp. It helps with dandruff because it has antiseptic and anti-inflammatory properties. It also helps strengthen hair roots which will help with hair loss.', 'Improves\r\n  scalp condition.<br><br>Treats\r\n  flaky scalp and scalp psoriasis.<br><br>Anti-Fungal properties stops dandruff\r\n  production.<br>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>No Preservatives used<br><br>Paraben free<br><br>100% natural Product<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances<br>', 'Apply on scalp &amp; massage gently with fingertips. Leave overnight.\r\n<br><br>For best results wash hair with Sheen Anti Dandruff Shampoo.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', '<span>Anti Dandruff Hair Oil is suitable for: <br>\r\n<br>\r\n<b>Hair type</b> - All<br>\r\n<b>Gender </b>- Unisex product<br>\r\n<br></span><span><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br>PATCH TEST is advisable before adding a new product to your routine. Apply the product to your hairline and observe for the next 24 hours. <br>If there is no reaction, you can apply the product to your hair. <br>If the scalp is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product.<br>If irritation occurs, please discontinue the product and consult a dermatologist.<br>', 150, 145, '', '100 ml', 1, 'Anti Dandruff Front-min.jpg', 'Anti Dandruff Back-min.jpg', 5, '5', 'Anti Dandruff Front-min.jpg', 'Anti Dandruff Back-min.jpg', '', '', 1, '1'),
(81, 8, 48, 47, 'Anti Hairfall Hair Oil ', '<b>With Goodness Of Thyme &amp; Tamanu Oil</b>', 'Perfect blend of 100% Natural Cold Pressed Oils.&nbsp;Sheen Anti Hairfall Oil is perfect mixture of nutrient rich oils that strengthen the hair right from the roots preventing hair loss, breakage, split ends and frizz.', '<b>Tamanu Oil</b><br>It is rich source of\r\nOleic Acid, Linoleic Acid, Palmitic Acid, and Stearic Acid. Tamanu Oils\r\nnourishing and conditioning qualities are known to&nbsp;address hair loss\r\nconditions,&nbsp;encourage stronger, longer, and healthier\r\nhair growth. It hydrates the strands and brings out natural sheen of hair.<span><br><br></span><b>Thyme Oil</b><br>Thyme Oil&nbsp;helps promote hair growth by both stimulating the scalp and actively preventing hair loss. Thyme oil is also found to be helpful in treating alopecia.<br><b><br>Olive Oil</b> <br>It is rich in Oleic acid. Oleic acid has antioxidant and antibacterial properties, which play a role in a healthy scalp. Olive oil can soothe your scalp, strengthen your hair follicle, and potentially stimulate hair growth.<br><br><b>Sunflower Oil</b> <br>Sunflower Oil assists in stopping hair breakage. It has anti-inflammatory properties which may help calm dandruff and relieve an itchy scalp. <br><br><b>Coconut Oil</b> <br>Coconut Oil helps slow down hair loss by penetrating deep into your hair shaft to prevent protein loss, which in turn prevents breakage.  When applied to your scalp, it simultaneously moisturizes and removes build-up around your hair follicles to jumpstart hair growth.<br><br><b>Castor Oil</b> <br>It is rich in Ricinoleic acid - a type of fatty acid found to fight inflammation. When applied to the scalp, it is purported to enhance the health of the hair follicles and, in turn, promote hair growth (as well as protect against hair loss). <br><br><b>Vitamin E Oil</b><br>It stimulates the capillaries, thereby increasing blood flow to the scalp and encouraging hair growth. Vitamin E addresses the concerns of brittle,  dehydrated and premature ageing hair by extra protection against oxidative stress caused by environmental pollutants and other styling processes.<br><br><b>Clary Sage Oil</b> <br>It contains Linalyl\r\nacetate that makes this&nbsp;oil very effective in increasing hair growth. It improves\r\nhair strength, in addition to increasing hair growth.<br>', '<span><span><span>Controls\r\n  hair loss.<b></b></span>\r\n  </span>\r\n  &nbsp;</span><br><br>Strengthens\r\n  root.&nbsp;<br><br>Reduces cell damage and increases hair growth.&nbsp;<br>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>No Preservatives used<br><br>Paraben free<br><br>100% natural Product<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances<br>', 'Apply on scalp &amp; massage gently with\r\nfingertips. Leave overnight. <br>\r\n\r\n<br>For best results wash hair with Sheen\r\nHair Care Shampoo.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', '<span>Anti Hairfall Hair Oil is suitable for: <br>\r\n<br></span><span>Hair type&nbsp;- All<br>Gender&nbsp;- Unisex product<br><br></span><span><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br>PATCH TEST is advisable before adding a new product to your routine. Apply the product to your hairline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product to your hair.<br>If the scalp is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product.<br>If irritation occurs, please discontinue the product and consult a dermatologist.<br>', 150, 145, '', '100 ml', 1, 'Anti Hair fall Front-min.jpg', 'Anti Hair fall back-min.jpg', 5, '5', 'Anti Hair fall Front-min.jpg', 'Anti Hair fall back-min.jpg', '', '', 1, '1'),
(82, 8, 49, 48, 'Anti Dandruff Shampoo', '<b>Freedom From Dandruff &amp; Itchy Scalp</b>', 'This nourishing shampoo not only gives&nbsp;freedom from Dandruff &amp; Itchy scalp, but helps strengthen hair and improve scalp condition. Loaded with Tea Tree Essential Oil for Dandruff control and Aloe Vera to provide nourishment and moisturize hair.', '<b>Tea Tree Oil</b> <br><span>Due to its anti-bacterial and\r\nanti-inflammatory effects, Tea Tree Oil&nbsp;acts against dandruff &amp;\r\nreduces inflammation. It also soothes the scalp by acting on itchy dryness and\r\nallergies. It contains Terpinen4 which is anti-bacterial, anti-viral, and anti-fungal.\r\nTea Tree Oil&nbsp;improves blood flow that allows nutrients to\r\nreach&nbsp;hair&nbsp;follicles and balances the pH level of the&nbsp;scalp.<br></span><br><b>Vitamin E Oil</b><br>Vitamin E Oil help support a healthy scalp and&nbsp;hair&nbsp;as it has natural antioxidant effects that could assist in maintaining&nbsp;hair&nbsp;growth. The&nbsp;antioxidant properties help reduce the amount of oxidative stress and free radicals that cause the&nbsp;hair&nbsp;follicle cells in a person scalp to break down.<span><br><br></span><b>Aloe Vera</b><br>Aloe Vera has enzyme and fatty acid content that helps to reduce inflammation and also reduces scalp irritation &amp; provides moisturizing effect. It is rich in Vitamin C, E, B12, Folic acid, and Choline content that nourishes and strengthens hair.<br><br><b>Glycerin</b><br>It acts as a humectant, a substance that allows the scalp to retain moisture.<br><br>&nbsp;<br>', 'Visibly reduces Dandruff with every use.<br><br>Deep cleanses grim and dead cells and unclogs the follicles.<br><br>Restores pH balance, soothes the scalp.<br><br>Keeps the scalp hydrated and nourished.<br><br>This shampoo is gentle enough for everyday use.&nbsp;<br>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>Paraben free<br><br>Balanced pH (between 5-5.5)<br>', 'Gently massage the shampoo into wet hair and scalp and create rich lather. Leave for couple of minutes, and then rinse thoroughly. Repeat if necessary.<span><br>\r\n<br>\r\nFor best results use Sheen Nourishing Conditioner.&nbsp;</span>', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', '<span>Anti Dandruff Shampoo is suitable for: <br><br>\r\nHair type - Dry&nbsp;<br>\r\nGender - Unisex product<br><br>\r\n<b>Expecting and Breastfeeding mothers</b> - Please always check with your Doctor\r\nprior to use.<br><br></span>PATCH TEST is advisable before adding a new product to your routine. Apply the product to your hairline and observe for the next 24 hours. <br>If there is no reaction, you can apply the product to your hair. <br>If the scalp is sensitive, continue the test for 7 days. This helps ensure you are not allergic to any ingredient. <br>If irritation occurs, please discontinue the product and consult a dermatologist.<br>', 165, 155, '', '175 gm', 1, 'Anti Dandruff Shampoo Front-min.jpg', 'Anti Dandruff Shampoo Back 1.jpg', 5, '5', 'Anti Dandruff Shampoo Front-min.jpg', 'Anti Dandruff Shampoo Back 1.jpg', '', '', 1, '1'),
(83, 8, 49, 49, 'Haircare Shampoo', '<b>Pamper Your Hair With Vitamin B5, Aloe Vera &amp; Vitamin E&nbsp;</b>', 'Filled with active ingredients like Vitamin B5, Aloe Vera &amp; Vitamin E, this&nbsp;nourishing shampoo helps strengthen hair and improve scalp health. It has a gentle yet effective cleanser&nbsp;and conditioning properties.&nbsp;', '<b>Aloe Vera<br></b>Aloe Vera has enzyme and fatty acid content that helps to  reduce inflammation and also reduces scalp irritation &amp; provides moisturizing effect. \r\n\r\nIt is rich in Vitamin C, E, B12, Folic acid, and Choline content that nourishes and strengthens hair.\r\n<br><br><b>Vitamin B5</b> <br>Panthenol or Vitamin B5 is a humectant emollient that gives hair better texture, shine and strength. It gets deeply absorbed by the scalp thus preventing dry hair; binds hair follicles and seals the moisture. Being non greasy, it adds volume and helps detangle the hair.<br><br><b>Vitamin E Oil</b><br>Vitamin E Oil help support a healthy scalp and&nbsp;hair<span><b>&nbsp;</b>as it has natural antioxidant effects that could assist in maintaining&nbsp;</span>hair&nbsp;growth. The&nbsp;antioxidant properties help reduce the amount of oxidative stress and free radicals that cause the&nbsp;hair&nbsp;follicle cells in a person scalp to break down.<br><br><b>Glycerin</b><br>It acts as a humectant, a substance that allows the scalp to retain moisture.<br><br><br>', 'Deep cleanses grim and dead cells and unclogs the follicles.<br><br>Restores pH balance and soothes the scalp.<br><br>Balances oil and moisture content.<br><br>Antioxidant property gives extra protection to hair.<br>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>Paraben free<br><br>Balanced pH (between 5-5.5)<br>', 'Gently massage the shampoo into wet hair and scalp and create rich lather. Leave for couple of minutes, and then rinse thoroughly. Repeat if necessary.<br><br>For better results use Sheen Nourishing Conditioner.&nbsp;<br>', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', '<span>Hair Care&nbsp;Shampoo is suitable for: <br><br>\r\nHair type - All&nbsp;&nbsp;<br>\r\nGender - Unisex product<br><br>\r\n<b>Expecting and Breastfeeding mothers</b> - Please always check with your Doctor\r\nprior to use.<br><br>\r\nPATCH TEST is advisable before adding a new product to your routine. Apply the\r\nproduct to your hairline and observe for the next 24 hours. <br>If there is no\r\nreaction, you can apply the product to your hair. <br>If the scalp is sensitive,\r\ncontinue the test for 7 days. This helps ensure you are not allergic to any\r\ningredient. <br>If irritation occurs, please discontinue the product and consult a\r\ndermatologist.</span>', 165, 155, '', '175 gm', 1, 'Hair care Back-min.jpg', 'Hair care Front 1.jpg', 5, '5', 'Hair care Back-min.jpg', 'Hair care Front 1.jpg', '', '', 1, '1'),
(85, 7, 43, 32, 'Acne & Pimple Facial Serum', '<b>With Goodness Of Tea Tree\r\nEssential Oil &amp; Turmeric Extract</b>', 'Acne starts when skin flakes and skin oil\r\n(sebum) clogs your pores. A plugged pore becomes a breeding ground for\r\nbacteria,&nbsp;which contributes to causing pimples. Sheen Acne &amp; Pimple\r\nfacial serum is loaded with right mixture of 100% natural cold pressed Oils\r\nthat work deep inside the skin layers and have specific properties in fighting\r\nacne and pimple. This oil not only fight acne but also nourishes, heals and\r\nrejuvenates your skin with every use.', '<b>Tea Tree Oil</b><br>Due to its anti-bacterial\r\nand anti-inflammatory effects, Tea Tree Oil acts against acne breakouts,\r\nreduces redness and non-comedogenic (anti-pore clogging) and provides better\r\nhydration. It contains Terpinen4 which is anti-bacterial, anti-viral and anti-fungal.<span><br><br></span><span><b>Turmeric Extract</b><br></span>Revives skin&nbsp;by its antioxidant, anti-bacterial and anti-inflammatory properties. Treats acne, helps in collagen synthesis,&nbsp;lightens scars&nbsp;and stretch marks. Curcumin in turmeric protects&nbsp;skin cells from damage&nbsp;by free radicals, thereby reducing early signs of ageing. Contains Vitamins C, E and K; Curcumin, Tumerone Oil, and minerals like Calcium, Copper, Zinc; Beta carotene.<br><b><br>Jojoba Oil</b><br>Being a humectant, it seals the moisture. Its anti-bacterial property makes it effective against acne. It regulates sebum production and helps in collagen synthesis which reduces fine lines and scars. Jojoba Oil is rich in Vitamins C, B, E, Copper, Zinc and Omega 6 fatty acids.<br><br><b>Sunflower Oil</b> <br>It is rich in Vitamin A and Vitamin E which help in promoting skin health. These Vitamins act as antioxidants. They help in regenerating damaged skin cells and getting rid of the acne causing bacteria. Sunflower Oil also acts as a natural moisturizer and helps in treating dry and sensitive skin.&nbsp;&nbsp;&nbsp;<br><br><b>Evening Primrose Oil</b><br>Rejuvenates the complexion.&nbsp;Moisturises and soothes the skin improving texture and elasticity. Acts on wrinkles and skin irritations. Also known for its anti-inflammatory and antioxidant properties. It contains gamma Linolenic acid (GLA), an omega -6 fatty acid and Polyphenols.<br><br><b>Grapeseed Oil</b><br>Being anti-inflammatory,\r\nanti-microbial, antioxidant, it acts as anti-acne agent. Makes the skin moist\r\nand soft, improves the skin tone, and strengthens the skin barrier thus\r\npreventing loss of moisture. It is rich in Vitamin E, C, Omega 6 fatty acid, phenols\r\nand flavonoids.<br><br><b>Rosehip Oil</b><br>Addresses scars, pigmentation and wrinkles. Exfoliates, repairs damaged skin caused by free radicals and tightens pores giving flawless and firm skin. It is rich in Vitamin A, C and Essential fatty acids.<br><br><b>Neem Oil</b><br>Treats acne, warts,\r\nmoles, wounds, dryness and premature ageing. Boosts collagen production to\r\nreduce skin damage and keeps skin supple and hydrated. Neem oil is loaded with\r\nessential fatty acids like Palmitic acid, Linoleic acid and Oleic acid. Also\r\ncontains flavonoids and polyphenols; Vitamin E, Limonoids, Calcium, Iron,\r\nMagnesium and Phosphorus.<br><br><span><b>Frankincense Oil</b><br></span>Once known as liquid gold, it has wonderful skin benefits. Great for acne control, it removes excess oil, regulates sebum, lightens scars and regenerates skin cells resulting in glowing, even toned and smooth skin. It is rich in Vitamin B12, D, E, Copper, Zinc, Selenium, and Magnesium.<br><br><b>Vitamin E</b><br>A must for healthy skin, its antioxidant nature gives extra protection against oxidative stress, reverses signs of ageing, enhances collagen production, deep cleanses, and lightens dark spots.<br><br><b>Geranium Oil</b><br>Geranium Oils\r\nastringent effect allows skin tissues to tighten and contract, significantly\r\nreducing the appearance of wrinkles. It also has antioxidant effects to slow\r\ndown skin aging, helping you look younger. Geranium oil also helps keep your\r\nskin young and glowing by renewing blemished tissues. It can help fade acne\r\nscars and tone down the appearance of dark spots by promoting a balanced distribution\r\nof melanin, the pigment responsible for skin darkening.<br>', 'Controls acne and pimple breakouts by regulating sebum production.<br><br>Reverses\r\n  the oxidative cell damage by rejuvenating the structural integrity of the\r\n  skin.<br><br>Acts as antioxidant, antibacterial and antifungal.<br><br>Acts on acne scars and skin discolouration.<br>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>No Preservatives used<br><br>Paraben free<br><br>100% Natural Product<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances', 'Cleanse your face. Apply 2-3 drops of Facial Oil followed by gentle fingertip massage before sleeping.<br><br>For best results apply daily &amp; cleanse with&nbsp;Sheen Multani Mitti Oats Soap.&nbsp;', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', '<span>Acne &amp; Pimples Facial Serum is suitable for: <br>\r\n  <br>\r\n  Skin type - Oily <br>\r\n  Gender - Unisex product<br>\r\n  <br>\r\n  <b>Expecting and Breastfeeding mothers</b> - Please always check with your Doctor\r\n  prior to use.<br><br>\r\n  PATCH TEST is advisable before adding a new product to your routine. <br>\r\n  Apply the product on your inner elbow / jawline and observe for the next 24\r\n  hours. <br>\r\n  If there is no reaction, you can apply the product on your face. <br>\r\n  If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product. <br>If irritation occurs, please discontinue the product and consult a dermatologist.', 150, 145, '', '10 ml', 1, 'Acne Front-min.jpg', 'Acne-min.jpg', 5, '5', 'Acne Front-min.jpg', 'Acne-min.jpg', 'Acne Box-min.jpg', 'WhatsApp Image 2021-06-25 at 16.30.52 (1).jpeg', 1, '1');
