(86, 9, 46, 50, 'Hydrating Moisturizer', '<b>With Goodness Of Honey &amp; Shea Butter</b>', 'Nourishing and intensively hydrating, this formulation by Sheen\r\nquenches the thirst of dry, lifeless skin. Replenishes from deep within for\r\nthe smooth, supple and glowing skin.', '<span><b><span>Honey<br>\r\n</span></b><span>Age old ingredient of skin care, Honey is a humectant that\r\ndraws moisture from air for long lasting hydration. Cleans and clarifies the skin.\r\nIts exfoliating and anti-oxidant properties fade the scars, prevent skin imbalances,&nbsp;giving\r\nsmooth and glowing skin. Rich source of phenols-flavonoids, Vitamin B, Ascorbic\r\nacid, Pantothenic acid, Niacin, Riboflavin, Calcium, Copper, and Iron.<br>\r\n<br>\r\n<b>Shea Butter<br></b></span></span>Non-comedogenic\r\n(non-clogging) for pores, it penetrates the skin for intense nourishment\r\nand rejuvenation. Improves blood circulation for cell renewal which acts on\r\nwrinkles, acne scars and rough skin making it soft and blemish free. Contains\r\nVitamin A, Vitamin E ,Vitamin F; Triglycerides, Cetyl esters, Palmitic acid,\r\nStearic acid ,Linoleic acid and Oleic fatty acids.<span><br>\r\n<b><br>\r\n</b><b>Olive Oil<br></b></span>Anti-oxidant and\r\nanti-bacterial properties make Olive Oil fight premature ageing, help fade\r\nscars, reduce pigmentation, moisturise and hydrate the skin. Contains Vitamins\r\nE and K, Calcium, Potassium, Polyphenols and Squalene.<span><br>\r\n<b><br>\r\n</b><b>Grapeseed Oil<br>\r\n</b>Being anti-inflammatory, anti-microbial, anti-oxidant, it\r\nacts as anti-acne agent. Makes the skin moist and soft; improves the skin tone.\r\nIt strengthens the skin barrier, preventing loss of moisture. Rich in Vitamin E,\r\nC,&nbsp;Omega 6 fatty acid, Phenols, and Flavonoids.<br>\r\n<br>\r\n<b></b><b>Almond Oil<br>\r\n</b>This anti-inflammatory, nutritional powerhouse contains\r\nphytochemicals and healthy fats which repair the damaged dry skin, removes\r\npuffiness and dark circles, and improves skin tone and complexion. Contains\r\nVitamin D, A, E; Omega 3 fatty acid; Proteins, minerals like Zinc,&nbsp;Copper,\r\nMagnesium, Phosphorus, and Potassium.<br>\r\n<b><br>\r\n</b><b>Vitamin E Oil<br></b></span>A must for healthy\r\nskin, its anti-oxidant&nbsp;nature gives extra protection against oxidative\r\nstress, reverses signs of ageing, enhances collagen production, deep\r\ncleanses,&nbsp;and lightens dark spots and stretch marks.<span><span><br>\r\n<br>\r\n<b>Glycerin</b><br>\r\nGlycerin is great for the skin because it acts as\r\na humectant, a substance that allows the skin to retain moisture. It can\r\nincrease skin hydration, relieve dryness, and refresh the skin surface.&nbsp;</span><b></b></span><br><b><br><br></b><b><br></b>&nbsp; &nbsp;&nbsp;&nbsp;<b><br></b><b><br></b>', 'Moisturises and hydrates the skin\r\nfrom deep within.<br><br>Nourishes &amp; rejuvenates the skin&nbsp;by boosting cell regeneration.<br><br>Protects from environmental stress and free radicals.<br><br>Soothes skin rashes, itching and redness.<br>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>Paraben free<br><br>98% Natural ingredients used<br>', 'Apply this moisturizer gently all over the body, slowly massaging it in.\r\nBest used after bathing when your skin is most receptive to hydration.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified', '<div>Body Moisturizer is suitable for:&nbsp;</div><div><br></div><div>Skin type - All</div><div>Gender - Unisex product</div><div><br></div><div><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine.&nbsp;</div><div>Apply the product on your inner elbow / jawline and observe for the next 24 hours.&nbsp;</div><div>If there’s no reaction, you can apply the product on your body.&nbsp;</div><div>If skin is sensitive, continue the test for 7 days.&nbsp;Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div><div>If irritation occurs, please discontinue the product and consult a dermatologist.</div>', 199, 175, '', '100 gm', 1, 'Body Lotion Front-min.jpg', 'Body Lotion Back-min.jpg', 5, '5', 'Body Lotion Front-min.jpg', 'Body Lotion Back-min.jpg', '', '', 1, '1'),
(88, 9, 47, 41, 'Strawberry & Chia Seeds Handmade Soap', '<b>Exfoliating &amp; Refreshing</b>', 'Treat your body with our handmade\r\nGlycerin soap. It promotes healthier and even-toned skin. This glycerin soap is\r\nloaded with antioxidants and Omega 3 fatty acids. The combination of Chia Seeds and Coconut Oil helps boost your skins protective barrier layer, and keep signs of ageing at bay.<b></b>', '<b>Coconut Oil</b>\r\n\r\n<br>Coconut oil helps bolster your skins protective barrier\r\nlayer, trapping moisture inside and keeping skin supple and hydrated. Reduces\r\ninflammation. Coconut oil has anti-inflammatory properties, making it\r\nbeneficial for irritated, chafed skin. Increases collagen production.\r\n\r\n<b>&nbsp;</b>\r\n\r\n<br><b><br>Chia Seeds</b>\r\n\r\n<br>With a punch of antioxidants, chia seeds powers up skin\r\nbarriers to fight free radicals and UV damage, and keep signs of ageing at bay.\r\nCooling benefits of chia calms inflammation. Rich in omega-3 fatty acids, these\r\ntiny seeds have a healing effect on the skin that offers protection against the\r\nacne-causing bacteria, and helps diminish blemishes.\r\n\r\n<span><br>\r\n<br>\r\n<b>Glycerin Soap Base</b><br>\r\nGlycerin, or glycerol, is derived from\r\nplant-based oils.&nbsp;Glycerin is a humectant, which means it attracts\r\nmoisture and draws it deep into your skin to keep it hydrated.</span>', '<span>Removes dead skin &amp; keeps skin radiant and healthy.<br></span><br>Loaded with\r\n     antioxidants and Omega 3 fatty acids.<br><br>Fights anti-aging, and soothes inflammation.<br><br><br>', 'All the oils used in this soap are 100% Natural &amp; Cold Pressed<br><br>Handmade<br><br>Balanced pH<br><br>Soft on Skin<br><br>Retains Moisture', 'Work up a lather by rubbing the soap between your palms. Spread lather on your wet face and body in gentle strokes.&nbsp;Scrub your body gently and wash off with water. Pat dry with a soft towel &amp; follow this up with your favourite Sheen Care Moisturizer to lock in the goodness.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', 'Strawberry &amp; Chia Seeds Soap&nbsp;is suitable for:&nbsp;<div><br></div><div>Skin type - All&nbsp;</div><div>Gender - Unisex product</div><div><br></div><div><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine.&nbsp;</div><div>Apply the product on your inner elbow / jawline and observe for the next 24 hours.&nbsp;</div><div>If there’s no reaction, you can apply the product on your body.&nbsp;</div><div>If skin is sensitive, continue the test for 7 days.&nbsp;Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div><div>If irritation occurs, please discontinue the product and consult a dermatologist.</div>', 65, 60, '', '100 gm', 1, 'ChiaFront.jpg', 'ChiaBack.jpg', 4, '4/5', 'ChiaFront.jpg', 'ChiaBack.jpg', 'Chia-min.jpg', '', 1, '1'),
(89, 9, 47, 42, 'Vitamin E Handmade Soap', '<b>Rejuvenating &amp; Nourishing</b>', 'Treat your body with our handmade\r\nGlycerin soap. It promotes healthier and even-toned skin. This Vitamin E soap nourishes\r\nand protects your skin from damage. The combination of Vitamin E Oil and\r\nCoconut Oil helps boost your skins protective barrier layer, gives extra protection against oxidative stress, reverses\r\nsigns of ageing, and enhances collagen production.', '<span><b>Vitamin E Oil</b><span><br>\r\nVitamin E Oil is a powerful antioxidant that may\r\nbe effective at reducing damage in skin. Vitamin E help nourish and protect\r\nyour skin from damage caused by free radicals.</span> Its anti-oxidant nature gives extra protection against\r\noxidative stress, reverses signs of ageing, enhances collagen production, deep\r\ncleanses, and lightens dark spots.</span>\r\n\r\n&nbsp;\r\n\r\n<br><b><br>Coconut Oil</b>\r\n<br>Coconut oil helps bolster your skins protective barrier\r\nlayer, trapping moisture inside and keeping skin supple and hydrated. Reduces\r\ninflammation. Coconut oil has anti-inflammatory properties, making it\r\nbeneficial for irritated, chafed skin. Increases collagen production.\r\n\r\n<span><br>\r\n<br>\r\n<b>Glycerin Soap Base</b><br>\r\nGlycerin, or glycerol, is derived from\r\nplant-based oils.&nbsp;Glycerin is a humectant, which means it attracts\r\nmoisture and draws it deep into your skin to keep it hydrated.</span>', 'Moisturizes skin.<br><br>Slows aging and wrinkles formation.<br><br>Treats dark pigmentation.<br><br>Vitamin E is beneficial in reducing damage caused by UV radiations to skin.<br>', 'All the oils used in this soap are 100% Natural &amp; Cold Pressed<br><br>Handmade<br><br>Balanced pH<br><br>Soft on Skin<br><br>Retains Moisture', 'Work up a lather by rubbing the soap between your palms. Spread lather on your wet face and body in gentle strokes.&nbsp;Scrub your body gently and wash off with water. Pat dry with a soft towel &amp; follow this up with your favourite Sheen Care Moisturizer to lock in the goodness.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', 'Vitamin E Soap&nbsp;is suitable for:&nbsp;<div><br></div><div>Skin type - Dry &amp; Aging Skin</div><div>Gender - Unisex product</div><div><br></div><div><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine.&nbsp;</div><div>Apply the product on your inner elbow / jawline and observe for the next 24 hours.&nbsp;</div><div>If there’s no reaction, you can apply the product on your body.&nbsp;</div><div>If skin is sensitive, continue the test for 7 days.&nbsp;Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div><div>If irritation occurs, please discontinue the product and consult a dermatologist.</div>', 65, 60, '', '100 gm', 1, 'VitaminEFront-min.jpg', 'VitaminEBack-min.jpg', 5, '5/5', 'VitaminEFront-min.jpg', 'VitaminEBack-min.jpg', 'VitaminE-min.jpg', '', 1, '1'),
(90, 9, 47, 43, 'Haldi Chandan & Kesar Handmade Soap', '<b>Natural Glow &amp; Skin Lightening</b>', 'Treat your body with our handmade\r\nGlycerin soap. It promotes healthier and even-toned skin. This glycerin soap cleanses,\r\ntones and nourishes your skin. The combination of Haldi, Chandan &amp; Kesar have\r\nwonderful effects on your skin. It keeps your skin clean, glowing and protects skin\r\nfrom bacteria.<br>', '<span><b>Haldi</b><span><br>\r\nHaldi (Turmeric powder) has anti-inflammatory,\r\nanti-microbial, and antioxidant effects, which can benefit the skin in many ways.</span>\r\nIt helps heal and prevent dry skin. Turmeric slows the skin aging process, and is used to\r\ndiminish wrinkles, keep skin supple, and improve skins elasticity.</span>\r\n\r\n&nbsp;\r\n\r\n<br><b><br>Chandan</b>\r\n\r\n<br>The&nbsp;advantages of Chandan (Sandalwood)&nbsp;for&nbsp;skin&nbsp;are tremendous. From\r\ndaily skin care, to fighting skin blemishes, healing rashes, delaying wrinkles\r\nand lines, and reducing dullness and tans Sandalwood or Chandan is greatly\r\nvalued in Ayurveda for its incredible health and beauty benefits.&nbsp;\r\n\r\n<br><b><br>Kesar</b>\r\n\r\n<br>Kesar (Saffron) has been known to possess numerous beauty\r\nbenefits. It has been a time-honoured ingredient in nurturing skin, making it\r\nblemish free and radiant. With its amazing anti-bacterial and\r\nanti-inflammatory qualities, saffron is an ideal ingredient for treating acne\r\nand breakouts. The skin soothing and lightening qualities of saffron\r\nmakes it handy for skin tan removal.\r\n\r\n<span><br>\r\n<br>\r\n<b>Glycerin Soap Base</b><br>\r\nGlycerin, or glycerol, is derived from\r\nplant-based oils.&nbsp;Glycerin is a humectant, which means it attracts\r\nmoisture and draws it deep into your skin to keep it hydrated.</span>', 'Inhibits hyper pigmentation, exfoliates skin, and soothes sunburn.<br><br>Removes sun tan, tightens &amp; lightens skin tone.<br>', 'All the oils used in this soap are 100% Natural &amp; Cold Pressed<br><br>Handmade<br><br>Balanced pH<br><br>Soft on Skin<br><br>Retains Moisture<br>', 'Work up a lather by rubbing the soap between your palms. Spread lather on your wet face and body in gentle strokes.&nbsp;Scrub your body gently and wash off with water. Pat dry with a soft towel &amp; follow this up with your favourite Sheen Care Moisturizer to lock in the goodness.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', 'Haldi Chandan Kesar Soap&nbsp;is suitable for:&nbsp;<div><br></div><div>Skin type - All&nbsp;</div><div>Gender - Unisex product</div><div><br></div><div><br></div><div><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine.&nbsp;</div><div>Apply the product on your inner elbow / jawline and observe for the next 24 hours.&nbsp;</div><div>If there’s no reaction, you can apply the product on your body.&nbsp;</div><div>If skin is sensitive, continue the test for 7 days.&nbsp;Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div><div>If irritation occurs, please discontinue the product and consult a dermatologist.</div>', 65, 60, '', '100 gm', 1, 'HaldiFront-min.jpg', 'HaldiBack-min.jpg', 5, '5', 'HaldiFront-min.jpg', 'HaldiBack-min.jpg', 'Haldi-min.jpg', '', 1, '1'),
(91, 9, 47, 44, 'Neem Handmade Soap', '<b>Skin Protection &amp; Healing</b>', 'Treat your body with our handmade Glycerin soap. It promotes healthier and germ free skin. This glycerin soap deeply hydrates the skin and helps restore its natural skin tone. The combination of Neem leaves and Neem Oil works magic on your skin. This soap helps&nbsp;<span>reduce acne, fungal and bacterial infections.<br>&nbsp;</span><br>', '<b>Neem Leaves &amp; Oil</b><br>Neem&nbsp;Oil\r\ncontains the necessary fatty acids, which protect your skin and makes your&nbsp;skin&nbsp;healthy<span>.&nbsp;The&nbsp;Neem&nbsp;oil is believed to\r\nrelieve&nbsp;skin&nbsp;dryness,&nbsp;skin&nbsp;itchiness and redness. It also\r\nprevents pimples and&nbsp;skin&nbsp;blemishes.&nbsp;Neem leaves have\r\nanti-inflammatory property that reduces acne.&nbsp;<br></span><br><span><b>Glycerin Soap Base</b><br></span>Glycerin, or glycerol, is derived from plant-based oils.&nbsp;Glycerin is a humectant, which means it attracts moisture and draws it deep into your skin to keep it hydrated.<br>', 'Helps to reduce acne, fungal infections, protects skin.<br><br>Relieves itching and redness.<br><br><br><b></b>', 'All the oils used in this soap are 100% Natural &amp; Cold Pressed<br><br>Handmade<br><br>Balanced pH<br><br>Soft on Skin<br><br>Retains Moisture<br>', 'Work up a lather by rubbing the soap between your palms. Spread lather on your wet face and body in gentle strokes.&nbsp;Scrub your body gently and wash off with water. Pat dry with a soft towel &amp; follow this up with your favourite Sheen Care Moisturizer to lock in the goodness.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', 'Neem Soap&nbsp;is suitable for:&nbsp;<div><br></div><div>Skin type - All&nbsp;</div><div>Gender - Unisex product<br><br></div><div><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine.&nbsp;</div><div>Apply the product on your inner elbow / jawline and observe for the next 24 hours.&nbsp;</div><div>If there’s no reaction, you can apply the product on your body.&nbsp;</div><div>If skin is sensitive, continue the test for 7 days.&nbsp;Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div><div>If irritation occurs, please discontinue the product and consult a dermatologist.</div>', 65, 60, '', '100 gm', 1, 'NeemFront-min.jpg', 'neemback-min.jpg', 5, '5', 'NeemFront-min.jpg', 'neemback-min.jpg', 'Neem-min.jpg', '', 1, '1'),
(92, 9, 47, 45, 'Multani Mitti & Oats', '<b>Purifies &amp; Cleanses</b>', 'Treat your body with our handmade Glycerin soap. It promotes healthier and even-toned skin. This glycerin soap deeply hydrates the skin and helps restore its natural skin tone. The Multani Mitti-Oats-Aloe Vera combination&nbsp;relieves the&nbsp;skin&nbsp;from irritation,&nbsp;helps soothe sunburn, and reduces infection and acne.<br>', '<b>Multani Mitti<br></b>Multani Mitti relieves the&nbsp;skin&nbsp;from irritation, redness, and itching.&nbsp;It is natural and has no side effects.&nbsp;<br><br><b>Oats<br></b>Its antioxidant and anti-inflammatory properties help to treat dry&nbsp;skin&nbsp;and remove dead&nbsp;skin&nbsp;cells.&nbsp;Oats&nbsp;also contain compounds called saponins, which are natural cleansers. They remove the dirt and oil that clog the pores and exfoliate the&nbsp;skin.<br><br><b>Aloe Vera<br></b>Aloe Vera helps soothe sunburn and moisturize the skin. It also fights skin aging, reduces infection and acne, and lightens the blemishes on face.<br><br><b>Glycerin Soap Base<br></b>Glycerin, or glycerol, is derived from plant-based oils.&nbsp;Glycerin is a humectant, which means it attracts moisture and draws it deep into your skin to keep it hydrated.<b><br></b><br><br>', 'Effective against acne and helps in healing process.<br><br>Removes dead skin cells, blackheads &amp; whiteheads.<br><br>Protects skin against pollution.<br>', 'All the oils used in this soap are 100% Natural &amp; Cold Pressed<br><br>Handmade<br><br>Balanced pH<br><br>Soft on Skin<br><br>Retains Moisture<br>', 'Work up a lather by rubbing the soap between your palms. Spread lather on your wet face and body in gentle strokes.&nbsp;Scrub your body gently and wash off with water. Pat dry with a soft towel &amp; follow this up with your favourite Sheen Care Moisturizer to lock in the goodness.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', 'Multani Mitti &amp; Oats Soap&nbsp;is suitable for:&nbsp;<div><br></div><div>Skin type - Oily &amp;&nbsp;Acne Prone Skin</div><div>Gender - Unisex product<br><br></div><div><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></div><div>PATCH TEST is advisable before adding a new product to your routine.&nbsp;</div><div>Apply the product on your inner elbow / jawline and observe for the next 24 hours.&nbsp;</div><div>If there’s no reaction, you can apply the product on your body.&nbsp;</div><div>If skin is sensitive, continue the test for 7 days.&nbsp;Kindly ensure you are not allergic to any ingredient used in this product.&nbsp;</div><div>If irritation occurs, please discontinue the product and consult a dermatologist.</div>', 65, 60, '', '100 gm', 1, 'OatsFront-min.jpg', 'oatsBack-min.jpg', 5, '5', 'OatsFront-min.jpg', 'oatsBack-min.jpg', 'oats-min.jpg', '', 1, '1'),
(128, 7, 43, 33, 'Brightening and Lightening Facial Serum', '<b>With Goodness Of Neroli Essential Oil &amp; Alpinia Root&nbsp;Extract</b><b>&nbsp;</b>', '<div> Sheen Brightening and Lightening Facial Serum&nbsp;has the right mix of natural goodness and power\r\npacked nutrients that work deep inside the skin layers. This serum lightens your skin tone and makes it brighter and radiant.&nbsp;This serum has the goodness of natural oils that addresses the concerns of skin problems like blemishes, dullness and uneven skin tone. It nourishes, heals\r\nand rejuvenates skin with every use.</div>', '<b>Neroli Essential Oil<br></b>Neroli Oil has anti-microbial,\r\nanti-fungal, anti-oxidant and anti-inflammatory properties that soothes skin\r\nirritation. It reduces dark spots, acne scars, fine lines and wrinkles. It is\r\nrich in Vitamin C, Farnesol, Alpha terpineol, Limonene, and Nerolidol.<br><b><br></b><b>Alpinia Root Extract<br></b>Fights the adverse skin effects of climate changes and free radicals. Helps protect skin stem cells, repair and renewal of skin barrier; collagen production and skin hydration.<span><br><br></span><b>Rosehip Oil<br></b>Addresses scars,\r\npigmentation and wrinkles. Exfoliates, repairs damaged skin caused by free radicals\r\nand tightens pores giving flawless and firm skin. It is rich in Vitamin A, C\r\nand Essential fatty acids.<br><b><br>Evening Primrose Oil</b><br><span>Rejuvenates the\r\ncomplexion.&nbsp;Moisturises and soothes the skin improving texture and elasticity.\r\nActs on wrinkles and skin irritations. Also known for its anti-inflammatory and\r\nantioxidant properties. It contains gamma Linolenic acid (GLA), an omega -6\r\nfatty acid and Polyphenols.<br></span><br><span>\r\n \r\n <span>\r\n  <b>Sea\r\n  Buckthorn Oil\r\n <br></b></span></span>It contains good antioxidant properties which make it an important part of maintaining a youthful complexion by fighting against free radicals and delaying the signs of aging. Rich in Palmitic acid, it creates an occlusive layer on the skin that acts as protection against weathering.<br><b><br>Rice Bran Oil\r\n <br></b>Gamma oryzanol in Rice Bran\r\nOil protects skin from sun damage. It is hypoallergenic, making it a suitable\r\nremedy for hypersensitivity, itching&nbsp;and irritation. Has antioxidant and anti-inflammatory&nbsp;properties.&nbsp;Rice Bran Oil<b>&nbsp;</b>contains Gamma oryzanol, Vitamin E, Vitamin B, Omega 3, 6\r\nfatty acids – Oleic acid, Linoleic acid, Squalene and CoQ10.<span><br><b>\r\n </b><span><b>\r\n  </b><br><b>Raspberry&nbsp;Seed\r\n  Oil\r\n </b><br></span></span>Raspberry&nbsp;Seed Oil improves softness, suppleness and elasticity of the skin, helping to smooth out fine lines and wrinkles and firm sagging skin.<br><span><b>\r\n </b><span><b>\r\n  </b><br><b>Licorice\r\n  Extract\r\n <br></b></span></span>Treats hyperpigmentation,\r\nmaking the skin bright, even toned and blemish free. It has anti-inflammatory\r\nand antimicrobial properties.&nbsp;Licorice Extract is good source of&nbsp;Glycyrrhizin, Glabridin, and Licochalcone.&nbsp;<span><span>&nbsp;<br></span><b>\r\n </b><span><b>\r\n  </b><br><b>Ginseng\r\n  Extract\r\n <br></b></span></span>Boosts skin health by improving blood circulation and collagen synthesis. It balances oil production for acne control and treats hyper pigmentation and dull skin.<br><span><br><b>Turmeric\r\n  Extract\r\n <br></b></span>Revives skin&nbsp;by its\r\nantioxidant, anti-bacterial and anti-inflammatory properties. Treats acne,\r\nhelps in collagen synthesis,&nbsp;lightens scars&nbsp;and stretch marks. Curcumin\r\nin turmeric protects&nbsp;skin cells from damage&nbsp;by free radicals, thereby\r\nreducing early signs of ageing. Contains Vitamins C, E and K; Curcumin, Tumerone\r\nOil, and minerals like Calcium, Copper, Zinc; Beta carotene.<span><br><b>\r\n </b><span><b>\r\n  </b><br><b>Grapefruit\r\n  Essential Oil\r\n </b><br></span></span>Grapefruit Essential Oil helps fight bacteria and greasiness that can cause acne blemishes. It may also be useful for keeping your skin’s immunity strong against indoor and outdoor air pollution.<span><br><b>\r\n </b><span><b>\r\n  </b><br><b>Vitamin E Oil<br></b></span></span>A must for healthy skin, its antioxidant nature gives extra protection against oxidative stress, reverses signs of ageing, enhances collagen production, deep cleanses, and lightens dark spots.<span><b><br></b>\r\n </span>', 'Lightens\r\n  and Brightens the uneven&nbsp;skin tone.<br><br>Reduces\r\n  excess production of melanin.<br><br>Acts\r\n  against Photo aging&nbsp;and Blemishes.<br><br>Nourishes and hydrates the skin.<br><br>Enhances\r\n  the structural integrity of the skin.<br>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>No Preservatives used<br><br>Paraben free<br><br>100% Natural Product<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances<br>', 'Cleanse your face. Apply 2-3 drops of Facial Oil followed by gentle fingertip massage before sleeping.<br><br>For best results apply daily &amp; cleanse with&nbsp;Sheen Haldi Chandan &amp; Kesar Soap.&nbsp;', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', '<span>Brightening and Lightening Facial Serum is suitable for:<br><br>Skin type - All<br>Gender - Unisex product<br><br><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></span><span>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product on your face.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product.<br>If irritation occurs, please discontinue the product and consult a dermatologist.<br>', 150, 145, '', '10 ml', 1, 'Brighten Front-min.jpg', 'Brighten-min.jpg', 5, '5', 'Brighten Front-min.jpg', 'Brighten-min.jpg', 'Brighten Box-min.jpg', 'WhatsApp Image 2021-06-25 at 16.30.51.jpeg', 1, '1'),
(129, 7, 43, 34, 'Anti Aging Facial Serum', '<b>With Goodness Of Frankincense Essential Oil &amp; Eco Marine Algae&nbsp;Extract</b>', 'Loaded with the richness of nutrients and antioxidants, this serum does\r\nnot let the age show. Intensively rejuvenates, moisturises and smoothens out\r\nfine lines and wrinkles for that ever radiant and youthful look.&nbsp;', '<b>Frankincense Oil<br></b>Once known as liquid gold,\r\nit has wonderful skin benefits. Great for acne control, it removes excess oil, regulates\r\nsebum, lightens scars and regenerates skin cells resulting in glowing, even\r\ntoned and smooth skin. It is rich in Vitamin B12, D, E, Copper, Zinc, Selenium,\r\nand Magnesium.<br><b><br></b><b>Eco Marine Algae Extract<br></b><span>It provides protection to structural skin proteins,&nbsp;improves skin elasticity and collagen.&nbsp;Power house of Vitamins A, C, E; Carotenoids, Essential fatty acids, Sterols, Minerals, Flavonoids, and Polysaccharides. All these properties make&nbsp;Eco Marine Algae Extract powerful anti-wrinkle agent.<br></span><b><br></b><b>Hibiscus Extract<br></b>Hibiscus Extract&nbsp;is well known for anti-aging benefits. It slows breakdown of collagen and elastin, and reduces oxidative stress on skin cells. Encourages skin cell regeneration and hydration.&nbsp;Helps exfoliate and brighten the skin.<b><br><br>Turmeric Oil<br></b>Long considered as\r\nsuperfood in the health world, antioxidant-packed&nbsp;turmeric&nbsp;is a\r\nwonder ingredient for your&nbsp;skin&nbsp;too. Its anti-inflammatory\r\nproperties&nbsp;help calm redness, reduce the appearance of scarring and\r\nbrighten your skin.<br><b><br></b><span><b>Macadamia&nbsp;Oil</b><br></span><span>A great emollient for very dry\r\nskin, it gets easily absorbed to replenish the skin. Regulates sebum production,\r\nstrengthens the protective barrier and prevents TEWL. It is hypoallergenic and\r\nworks on itches and rashes. Moisturises and hydrates the skin, reduces fine lines and wrinkles.<br></span><b><br></b><b>Camellia Oil<br></b><span>It is very rich in Oleic acid, and other fatty acids present are Palmitic, Stearic and Linoleic. Camellia Oil\r\nreduces TEWL and can be an effective anti-wrinkle agent. It has an\r\nanti-inflammatory, anti-microbial and antioxidant properties as well.<br><br></span><b>Jojoba Oil<br></b>Being a humectant, it seals\r\nthe moisture. Its anti-bacterial property makes it effective against acne. It regulates\r\nsebum production and helps in collagen synthesis which reduces fine lines and\r\nscars. Jojoba Oil is rich in Vitamins C, B, E, Copper, Zinc and Omega 6 fatty\r\nacids.<br><br><b>Raspberry Seed Oil<br></b><span>Raspberry&nbsp;Seed Oil\r\nimproves softness, suppleness and elasticity of the skin, helping to smooth out\r\nfine lines and wrinkles and firm sagging skin.<br></span><br><b>Sunflower Oil<br></b>It is rich in Vitamin A and\r\nVitamin E which help in promoting skin health. These Vitamins act as\r\nantioxidants. They help in regenerating damaged skin cells and getting rid of\r\nthe acne causing bacteria. Sunflower Oil also acts as a natural moisturizer and\r\nhelps in treating dry and sensitive skin.&nbsp;<span>&nbsp;<br></span><b><br></b><b>Sea Buckthorn Oil<br></b>It contains good\r\nantioxidant properties which make it an important part of maintaining a\r\nyouthful complexion by fighting against free radicals and delaying the signs of\r\naging. Rich in Palmitic acid, it creates an occlusive layer on the skin that\r\nacts as protection against weathering.<br><b><br></b><b>Almond Oil</b><b><br></b>This anti-inflammatory,\r\nnutritional powerhouse contains phytochemicals and healthy fats which repair\r\nthe damaged dry skin, removes puffiness and dark circles. It improves skin tone\r\nand complexion. Contains Vitamin D, A ,E ; Omega 3 fatty acid; proteins and\r\nminerals like Zinc, Copper, Magnesium, Phosphorus and Potassium.<br><br><b>Alpinia Leaf/Root Extract</b><br>Fights the adverse skin\r\neffects of climate changes and free radicals. Helps protect skin stem cells,\r\nrepair and renewal of skin barrier; collagen production and skin hydration.<br><br><b>Ginseng Extract<br></b>Boosts skin health by improving blood circulation and collagen synthesis. It balances oil production for acne control and treats hyper pigmentation and dull skin.&nbsp;<br><br><b>Sandalwood Oil<br></b>Sandalwood Oil\r\nprevents premature skin aging like blemishes, lines, wrinkles and sagging and helps\r\nreduce acne breakouts. It hydrates and cleanses skin and is also used&nbsp;in\r\naromatherapy. Contains alpha Santalol, Beta-Santalol, Oxygenated Terpene\r\nSantalol, Alpha Bergamotol, and Farsenol.<br><br><span><b>Vitamin E</b>&nbsp;<b>Oil</b><br></span>A must for healthy skin, its antioxidant nature gives extra protection against oxidative stress, reverses signs of ageing, enhances collagen production, deep cleanses, and lightens dark spots.<br><b><br><br></b><b><br></b>', 'Reverses\r\n  the skin damage due to exposure to sun, harsh environment and lifestyle.<br><br>Visibly\r\n  reduces the signs of premature ageing like uneven skin tone, dryness, dark\r\n  spots, lines and wrinkles.<br><br>Vitamins\r\n  and fatty acids replenish the skin, boost elasticity.<br><br>Repairs\r\n  the protective barrier and prevents TEWL (trans epidermal water loss).<br><br>Rejuvenates\r\n  with the structural proteins and collagen synthesis.<br>', 'All the oils used are 100% Natural &amp; Cold Pressed<br><br>No Preservatives used<br><br>Paraben free<br><br>100% Natural Product<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances<br>', 'Cleanse your face. Apply 2-3 drops of Facial Oil followed by gentle fingertip massage before sleeping.<br><br>For best results apply daily &amp; cleanse with Sheen Vitamin E Soap.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified<br>', '<span>Anti Aging Facial Serum&nbsp;is suitable for:<br><br>Skin type - Normal to Dry<br>Gender - Unisex product<br><br><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product on your face.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product. <br>If irritation occurs, please discontinue the product and consult a dermatologist.', 150, 145, '', '10 ml', 1, 'Anti Aging Front-min.jpg', 'Anti Aging-min.jpg', 5, '5', 'Anti Aging Front-min.jpg', 'Anti Aging-min.jpg', 'Anti Aging Box-min.jpg', 'WhatsApp Image 2021-06-25 at 16.30.53.jpeg', 1, '1'),
(136, 10, 53, 0, 'Melt & Pour Premium Soap Base', '<b>Effective Cleansing And Moisturizing</b>', 'This premium soap base is gentle on skin, and yet has effective cleansing properties.', 'Premium quality Glycerin Soap Base', '<span>Complies with TFM requirement.<br><br>Excellent fragrance retention across its life cycle.<br><br></span>Great Foaming.<br><br>Good Moisturizing Properties.<br>', 'Alcohol Free<br><br>Free Alkalinity - Nil<br><br>Balanced pH<br><br>Soft on Skin', 'Cut the desired quantity of soap base. Melt it in proper non-reactive vessels preferably Stainless Steel. Add Fragrance,&nbsp;colour,&nbsp;additives,&nbsp;as per your desire.', 'N/A', '<div>Skin type - All&nbsp;</div><div>Gender - Unisex product<br><br><div>The sole responsibility of the final determination of the&nbsp;suitability of the material lies with the end user(s). All customers who purchase this product from Sheen Care are hereby clearly notified that all such products must be&nbsp;used at the customers’/end users’ own discretion.&nbsp;<br><div>Sheen Care strongly recommends for small lab scale testing for evaluation purposes, prior to full commercial use and/or manufacturing.&nbsp;</div></div></div>', 600, 585, '', '1 Kg', 1, '2-min.png', '2-min.png', 5, '5', '', '', '', '', 1, '1'),
(137, 10, 53, 0, 'Melt & Pour Opaque Soap Base', '<b>Great Foaming Qualities &amp; Good Moisturizing Ability</b>', 'This soap base has great foaming qualities and good Moisturizing ability from a very high glycerin content which provides a pleasant skin feel.&nbsp;<img alt=\"\"><img alt=\"\">', 'Opaque Glycerin Soap Base', 'Vegetable Based<br><br>Great Foaming.<br><br>Good Moisturizing Properties.<br><br>Superior Colour Stability.<br><br>Neutral Odour provides excellent fragrance lift.<br><br>Heat stable.<br><br><br>', 'Amine Free<br><br>Free Alkalinity - Nil<br><br>Balanced pH<br><br>Soft on Skin', 'Cut the desired quantity of soap base. Melt it in proper non-reactive vessels preferably Stainless Steel. Add Fragrance,&nbsp;colour,&nbsp;additives,&nbsp;as per your desire.', 'N/A', '<div>Skin type - All&nbsp;</div><div>Gender - Unisex product<br><br><div>The sole responsibility of the final determination of the&nbsp;suitability of the material lies with the end user(s). All customers who purchase this product from Sheen Care are hereby clearly notified that all such products must be&nbsp;used at the customers’/end users’ own discretion.&nbsp;<br><div>Sheen Care strongly recommends for small lab scale testing for evaluation purposes, prior to full commercial use and/or manufacturing.&nbsp;</div></div></div>', 575, 550, '', '1 Kg', 1, '3-min.png', '3-min.png', 5, '5', '', '', '', '', 1, '1'),
(138, 10, 53, 0, 'Melt & Pour Sulphate Free Soap Base ', '<b>Crystal Clear Transparency&nbsp;</b>', 'Unique base for the preparation of Transparent Bathing Bar using Melt &amp; Pour Technology. With Sulphate free base you dont have to worry about harsh chemicals.', 'Sulphate Free Glycerin Soap Base', 'Complies with TFM requirement.<br><br>Generates good foam even in hard water.<br><br>Excellent fragrance retention across its life cycle.<br>', 'Sulphate Free<br><br>Alcohol &amp; Amine free<br><br><div>Free alkalinity ‒ Nil<br><br>Balanced pH<br></div><div><br></div><br>', 'Cut the desired quantity of soap base.\r\nMelt it in proper non-reactive vessels preferably Stainless Steel. Add&nbsp;Fragrance,&nbsp;colour,&nbsp;additives,&nbsp;as\r\nper your desire.', 'N/A', 'Skin type - All&nbsp;\r\n\r\n<br>Gender - Unisex product\r\n\r\n<br><br>The sole responsibility of the final determination of\r\nthe&nbsp;suitability of the material lies with the end user(s). All customers\r\nwho purchase this product from Sheen Care are hereby clearly notified that all\r\nsuch products must be&nbsp;used at the customers’/end users’ own\r\ndiscretion.&nbsp;\r\n\r\nSheen Care strongly recommends for small lab scale\r\ntesting for evaluation purposes, prior to full commercial use and/or\r\nmanufacturing.&nbsp;<br>', 700, 685, '', '1 Kg', 1, '4-min.png', '4-min.png', 5, '5', '', '', '', '', 1, '1'),
(144, 8, 50, 70, 'Nourishing Conditioner', '<b>With Goodness Of Jojoba Oil, Shea Butter &amp; Vitamin B5</b>', '<span>Deeply conditions and pampers your\r\ntresses, smoothens the texture and makes them shine with vitality.<b></b></span>', '<b>Jojoba Oil</b><br>Jojoba Oil is rich in Vitamins and minerals that nourish hair. It contains&nbsp;Vitamin C, B, E; Copper and Zinc. It strengthens hair hence prevent hair loss and promote hair thickness.<br><br><b>Shea Butter</b><br>Considered to be a hair stimulant, Shea butter revives growth by repairing hair follicles. It balances oil and moisture content, smoothens split ends and delays greying. It deep penetrates the scalp to moisturise and rejuvenate.<br><br><b>Panthanol - Vitamin B5</b><br>Panthenol or Vitamin B5 is a humectant emollient that gives hair better texture, shine and strength. It gets deeply absorbed by the scalp thus preventing dry hair; binds hair follicles and seals the moisture. Being non greasy, it adds volume and helps detangle the hair.<span><br><b></b></span><br><b>Vitamin E Oil<br></b>Vitamin E Oil help support a healthy scalp and&nbsp;hair&nbsp;as it has natural antioxidant effects that could assist in maintaining&nbsp;hair&nbsp;growth. The&nbsp;antioxidant properties help reduce the amount of oxidative stress and free radicals that cause the&nbsp;hair&nbsp;follicle cells in a person scalp to break down.<br><br><b>Almond Oil</b><br>This nourishing oil softens and strengthens your hair. It is rich in vitamin B7. Almond Oil helps to keep hair healthy and strong. Almond oil is also used as a scalp treatment.<br><br><b>Rice Bran Oil</b><br>It forms a protective barrier against hair damagers. Reduces dandruff, oxidative stress, dryness, brittleness, breakage and premature greying. It has anti-oxidant properties also.<br><br><b>Glycerin<br></b>It acts as a humectant, a substance that allows the scalp to retain moisture.', 'Intensive conditioning by Vitamins.<br>\r\n\r\n<span><span><br>Natural Oils hydrate and moisturise the hair.<br>\r\n<br>\r\n</span>Brings lifeless hair back to life with nourishment.<br>\r\n<br>\r\nProvides extra protection against damage by environmental\r\nfactors and hair&nbsp;treatments.<br>\r\n<br>\r\nPrevents breakage due to brittle hair and dry scalp.<br>\r\n<br>\r\nRestores hair softness and lustre.</span>', 'All\r\n     the oils used are 100% Natural &amp; Cold Pressed<br>\r\n\r\n<br>Paraben\r\n     free<br>', 'Rinse freshly\r\ncleansed hair and apply conditioner along the length of the hair. Leave on for\r\ntwo to three minutes. Rinse well till water runs clear.', 'FDCA Licensed Manufacturer<br><br>ISO 9001-2019 certified<br><br>GMP certified', '<span>Nourishing Conditioner is suitable for:<br><br>Hair type - Dry&nbsp;<br>Gender - Unisex product<br><br><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></span>PATCH TEST is advisable before adding a new product to your routine. Apply the product to your hairline and observe for the next 24 hours. <br>If there is no reaction, you can apply the product to your hair. <br>If the scalp is sensitive, continue the test for 7 days. This helps ensure you are not allergic to any ingredient. <br>If irritation occurs, please discontinue the product and consult a dermatologist.', 199, 175, '', '175 gm', 1, 'Conditioner Front-min.jpg', 'Conditioner Back 1.jpg', 5, '5', 'Conditioner Front-min.jpg', 'Conditioner Back 1.jpg', '', '', 1, '1'),
(147, 10, 53, 0, 'Melt & Pour Classic Soap Base', '<b>Rich Lather &amp; Cleansing&nbsp;</b>', 'This premium soap base is gentle on skin, and yet has effective cleansing properties.', 'Glycerin Soap Base', '<span>Complies with TFM requirement.<br><br></span>Rich Lather.<br><br>Good Moisturizing Properties.', 'Alcohol Free<br><br>Free Alkalinity - Nil<br><br>Balanced pH<br><br>Soft on Skin', 'Cut the desired quantity of soap base. Melt it in proper non-reactive vessels preferably Stainless Steel. Add Fragrance,&nbsp;colour,&nbsp;additives,&nbsp;as per your desire.', 'N/A', '<div>Skin type - All&nbsp;</div><div>Gender - Unisex product<br><br><div>The sole responsibility of the final determination of the&nbsp;suitability of the material lies with the end user(s). All customers who purchase this product from Sheen Care are hereby clearly notified that all such products must be&nbsp;used at the customers’/end users’ own discretion.&nbsp;<br><div>Sheen Care strongly recommends for small lab scale testing for evaluation purposes, prior to full commercial use and/or manufacturing.&nbsp;</div></div></div>', 425, 415, '', '1 Kg', 1, '1-min.png', '1-min.png', 5, '5', '', '', '', '', 1, '1'),
(148, 10, 52, 0, 'Tea Tree Essential Oil', '', 'Tea tree essential oil is commonly used for treating skin conditions that need antimicrobial activity – acne, cold sores, dandruff, etc. It can be very useful for preventing infections in damaged skin or insect bites, healing cuts and wounds, but most especially at helping with spots or acne prone skin.', 'Tea Tree Essential Oil&nbsp;<br><br>INCI Name -&nbsp;<span>Melaleuca Alternifolia<br><br></span>', '<div><div>Has a direct action against all three forms of harmful organisms – bacteria, virus and fungi.<br><br>Tea tree can be used for all skin types, all skin conditions, to encourage healing. <br><br>Useful for spots, acne, cuts, wounds, bites, stings, fungal infections, eczema, psoriasis, dermatitis, herpes, impetigo, cold sores, ulcers and rashes.<br><br><br><br><div></div></div></div><div><div></div><div></div></div>', 'Paraben free.<br><br>100% Natural Product.<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances.&nbsp;', 'As per end user discretion.&nbsp;', 'NA', '<span><b>Expecting and Breastfeeding mothers&nbsp;</b>- Please always check with your Doctor prior to use.<br><br>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your face.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product. If irritation occurs, please discontinue the product and consult a dermatologist.', 250, 245, '', '10 ml', 1, 'Dropper Bottle 1-min.png', 'TreeTeaEO.png', 5, '5', 'Dropper Bottle 1-min.png', 'TreeTeaEO.png', '', '', 1, '1'),
(160, 10, 52, 0, 'Peppermint Essential Oil', '', 'It treats acne, congested skin, dermatitis, ringworm, scabies and toothache. A steam solution is also an effective aid to decongesting and toning the skin with mild antiseptic qualities that help to soothe acne', 'Peppermint Essential Oil<br><br>INCI Name :&nbsp;Mentha Piperita', 'Peppermint has exceptional qualities, most notably its ability to soothe and literally ‘cool’ pain, irritation, inflammation and discomfort.<br><br>Peppermint is probably best known for its ability to clear away congestion (colds, blocked noses, chesty coughs).<br><br>Alleviate aches and pains (headaches and migraines).<br><br><br>', '100% Natural&nbsp;<br><br>No Preservatives used<br><br>Paraben free<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances', 'As per end user discretion.&nbsp;<br><br>It is advisable that peppermint only be used in low dilution and that application on sensitive skin be avoided. The aroma is so strong that in a blend it should be used in low dilution to avoid the blend being overpowered by peppermint’s strength.<br>', 'NA', '<span><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></span><span>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your skin.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product.<br>If irritation occurs, please discontinue the product and consult a dermatologist<br>', 350, 325, '', '10 ml', 1, 'Dropper Bottle 2-min.png', 'PeppermintEO.png', 5, '5', 'Dropper Bottle 2-min.png', 'PeppermintEO.png', '', '', 1, '1'),
(161, 10, 52, 0, 'Lavender Essential Oil', '', 'It has powerful skin-preserving qualities, helping to seal and heal open wounds. Lavender has a direct action on balancing sebum production, killing bacteria, cleaning and disinfecting the skin, keeping the pores open and providing an uplifting refreshing fragrance. It is helpful for acne-prone skin.', 'Lavender Essential Oil<br><br>INCI Name :&nbsp;Lavandula Angustifolia.', '<div><div>Promotes healthy skin growth &amp; stimulates skin cell regeneration.<br><br>Soothes pain, irritation and inflammation.<br><br>Softens and smoothens the skin.<br><br>An antidepressant that helps us stay positive, relaxed and calm.<br><br>Good for general skincare.<br><br>Alleviates digestive aches, pains and general discomfort.<div></div></div></div><div><div></div><div></div></div>', '100% Natural&nbsp;<br><br>No Preservatives used<br><br>Paraben free<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances', 'As per end user discretion.&nbsp;', 'NA', '<span><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></span><span>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your skin.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product.<br>If irritation occurs, please discontinue the product and consult a dermatologist.<br><br>', 350, 325, '', '10 ml', 1, 'Dropper Bottle 3-min.png', 'LavenderEO.png', 5, '5', 'Dropper Bottle 3-min.png', 'LavenderEO.png', '', '', 1, '1'),
(162, 10, 52, 0, 'Frankincense Essential Oil', '', 'Helps to heal blemishes, wounds, burns and scar tissue.Good for oily, dry and mature skin and believed to smooth out wrinkles.It has a real tonic effect restoring tone to the skin, especially of the face, and therefore slowing down the signs of aging and smoothing out wrinkles.', '<span>Frankincense Essential Oil<br><br>INCI Name : Boswellia Carteri&nbsp;<br><br></span>', '<div><div>An astringent that tightens and tones the skin tissue.<br><br>Antiseptic that cleanses the skin and kills bacteria.<br><br>Cytophylactic that stimulates skin cell regeneration and promotes healthy skin growth and healing. <br><br>Useful for aging skin. <br><br>Stimulates and focuses the mind, helping to improve concentration and memory. <br><br>It helps to alleviate stress, tension, anxiety and fear, lifting the spirits and promoting positive emotions.<br><br><div></div></div></div><div><div></div><div></div></div>', '100% Natural&nbsp;<br><br>No Preservatives used<br><br>Paraben free<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances', 'As per end user discretion.&nbsp;', 'NA', '<span><b>Expecting and Breastfeeding mothers&nbsp;</b>- Please always check with your Doctor prior to use.<br><br></span><span>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your skin.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product.<br>If irritation occurs, please discontinue the product and consult a dermatologist.<br>', 350, 325, '', '10 ml', 1, 'Dropper Bottle 4-min.png', 'Tea Tree EO (2)-min.png', 5, '5', 'Dropper Bottle 4-min.png', 'Tea Tree EO (2)-min.png', '', '', 1, '1');
