(164, 10, 52, 0, 'Sandalwood Essential Oil', '', 'As an emollient it is very good for all skin types because this helps to soften and smooth the skin. Extremely good for dry and dehydrated skin and as antiseptic is useful for spots.&nbsp;The aroma makes it a good oil to use for multiple skin and hair applications.&nbsp;', 'Sandalwood Essential Oil&nbsp;<br><br>INCI Name :&nbsp;Santalum Austrocaledonicum', '<div><div>Its emollient action softens and smooths the skin <br><br>Hydrates and moisturizes skin without leaving it feeling greasy or oily. <br><br>Wonderful nourishing and protecting qualities for the skin.<br><br><div></div></div></div><div><div></div><div></div></div>A strong antiseptic, it helps to heal bites and stings, cleans cuts and wounds and soothes inflamed or irritated conditions. <br><br>Popular amongst males because it is not floral or sweet, but instead stronger and earthy scent.<br><br>The aroma to many is calming, fortifying, strengthening and somehow still softening. <br><br>A restful aroma that stimulates peace of mind, promoting focus and clarity. Aids meditation.&nbsp;', '100% Natural&nbsp;<br><br>No Preservatives used<br><br>Paraben free<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances', 'As per end user discretion.&nbsp;', 'NA', '<span><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br></span><span>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your skin.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product.<br>If irritation occurs, please discontinue the product and consult a dermatologist<br>', 550, 525, '', '10 ml', 1, 'Dropper Bottle 5-min.png', 'Sandalwood Eo-min.png', 5, '5', 'Dropper Bottle 5-min.png', 'Sandalwood Eo-min.png', '', '', 1, '1'),
(165, 10, 52, 0, 'Neroli Essential Oil', '', 'Neroli Essential Oil is considered to be non-allergenic and can be used to reduce redness and irritation. It is beneficial for all skin types, especially dry skin. It is believed to have rejuvenating effects as it stimulates the cell growth cycle. Neroli has also been shown to be helpful at alleviating scars, stretch marks and dark spots.', 'Neroli Essential Oil<br><br>INCI Name :&nbsp;Citrus Aurantium<div><br></div>', '<div><div>Forms and heals scar tissue, encourages skin cell regeneration and promotes healthy cell growth.<br><br>Acts as an antibacterial agent and cleanses the skin.<br><br>Excellent for athlete’s foot, ringworm, eczema, psoriasis, acne, spots, dermatitis, chapped and broken skin, cuts and wounds, bites and stings, scars and stretch marks.<br><br>Excellent for sensitive skin; works on cell regeneration, is gentle and kills microbes that may cause harm or infection.<br><br>The aroma is euphoric and hypnotic as well as a sedative that alleviates stress and tension, reinstating a sense of confidence and creativity.<div></div></div></div><div><div></div><div></div></div>', '100% Natural&nbsp;<br><br>No Preservatives used<br><br>Paraben free<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances', 'As per end user discretion.&nbsp;', 'NA', '<span><b>Expecting and Breastfeeding mothers</b>&nbsp;- Please always check with your Doctor prior to use.<br><br>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product&nbsp;</span>(diluted with a carrier oil)&nbsp;<span>on your skin.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product. <br>If irritation occurs, please discontinue the product and consult a dermatologist', 450, 425, '', '10 ml', 1, 'Dropper Bottle 6-min.png', 'NeroliEO.png', 5, '5', 'Dropper Bottle 6-min.png', 'NeroliEO.png', '', '', 1, '1'),
(166, 10, 51, 0, 'Cold Pressed Jojoba Carrier Oil', '', 'Light and versatile oil with&nbsp;fast absorption. Beneficial for all skin types. Useful in the care of irritated and inflamed skin. Jojoba oil is a liquid wax with a unique composition so it cannot be substituted by any other oil.', 'Cold Pressed Jojoba Carrier Oil<br><br>INCI NAME :&nbsp;<span>Simmondsia Chinensis (Jojoba) Oil<br></span><br>', 'It works as an anti-inflammatory, which makes it useful in the care of irritated and inflamed skin like after shaving or acne-prone skin<div><br>Jojoba Oil contains natural antioxidants that make it very stable and not quick to oxidize.</div><div><br><span>An in-vitro study confirmed it accelerates wound healing.<br></span><br><span>It is a light and well absorbed oil that leaves a silky feeling on the skin.<br></span><br>Improves elasticity and suppleness of the skin.<br></div>', '100% Natural &amp; Cold Pressed Oil<br><br>No Preservatives used<br><br>Paraben free<br><br>Aroma derived from natural ingredients without any added or synthetic fragrances', 'As per discretion of user.&nbsp;', 'N/A', '<span><b>Expecting and Breastfeeding mothers&nbsp;</b>- Please always check with your Doctor prior to use.<br><br>PATCH TEST is advisable before adding a new product to your routine.<br>Apply the product on your inner elbow / jawline and observe for the next 24 hours.<br>If there is no reaction, you can apply the product on your face.<br>If skin is sensitive, continue the test for 7 days.&nbsp;</span>Kindly ensure you are not allergic to any ingredient used in this&nbsp;product. <br>If irritation occurs, please discontinue the product and consult a dermatologist.', 250, 235, '', '10 ml', 1, 'Dropper Bottle 7.png', 'Soap Base-min.png', 5, '5', 'Dropper Bottle 7-min.png', 'Soap Base-min.png', '', '', 1, '1');
