INSERT INTO `shipping_policy` (`shipping_policy_id`, `shipping_policy`) VALUES
(1, '<div><b>SHIPPING POLICY</b></div><div>Purchases are shipped from our warehouse in Vadodara, Gujarat by reputed and reliable courier partners.</div><div>It will take between 7-14 days for all Domestic deliveries, depending upon the location. Due to present Covid-19 guidelines, there may be bit variation in delivery timelines.</div><div>Order deliveries will be made between 9 am – 8 pm Monday – Saturday</div><div>•	FREE shipping for orders above Rs. 499/-</div><div>•	Rs. 75/- additional for all Cash on Delivery Orders.</div><div>Shipping and handling rates may vary based on product, packaging, size, volume, type and other considerations. The shipping and handling charges are given at the time of check out and consumers will know about this before making payments.</div><div>Sheencare is not responsible for damage after delivery.</div><div><br></div>');
