icable law, neither the Content nor any portion of this website may be used, reproduced, duplicated, copied, sold, resold, accessed, modified, or otherwise exploited, in whole or in part, for any purpose without our express, prior written consent.</div><div><br></div><div><b>THIRD PARTY LINKS</b></div><div>We are not responsible for the content of any off-website pages or any other websites linked to or from the sheencare.com website. Links appearing on this website are for convenience only and are not an endorsement by us, our affiliates or our partners of the referenced content, product, service, or supplier. You’re linking to or from any off-website pages or other websites is at your own risk. We are in no way responsible for examining or evaluating, and we do not warrant the offerings of, off-website pages or any other websites linked to or from the site, nor do we assume any responsibility or liability for the actions, content, products, or services of such pages and websites, including, without limitation, their privacy policies and terms and conditions. You should carefully review the terms and conditions and privacy policies of all off-website pages and other websites that you visit.</div><div><br></div><div><b>INDEMNITY</b></div><div>We disclaim all warranties or conditions, whether expressed or implied, (including without limitation implied, warranties or conditions of information and context). We shall not be liable to any person for any loss or damage which may arise from the use of any of the information contained in any of the materials on this Website. This User Agreement and any contractual obligation between us and you will be governed by the laws of India, subject to the exclusive jurisdiction of Courts in Vadodara. All disputes will be subject to arbitration in Vadodara in English by a single arbitrator appointed by us under the Arbitration and Conciliation Act, 1996. Each party to arbitration shall bear its own cost. You agree to defend, indemnif