to enclose the website or any portion thereof; (b) republish, redistribute, transmit, sell, license or download the website or any and/or all Content (except caching or as necessary to view the website); (c) make any use of the website or any and/or all Content other than personal use; (d) modify, reverse engineer or create any derivative works based upon either the website or any and/or all Content; (e) collect account information for the benefit of yourself or another party; (f) use any meta tags or any other “hidden text” utilizing any and/or all Content; or (g) use software robots, spiders, crawlers, or similar data gathering and extraction tools, or take any other action that may impose an unreasonable burden or load on our infrastructure. You must retain, without modification, all proprietary notices on the website or affixed to or contained in the website.</div><div>We also grant you a limited, revocable, and nonexclusive license to create a hyperlink to the home page of the website for personal, non-commercial use only. A website that links to the website (i) may link to, but not replicate, any and/or all of our Content; (ii) may not imply that we are endorsing such website or its services or products; (iii) may not misrepresent its relationship with us; (iv) may not contain content that could be construed as distasteful, obscene, offensive controversial or illegal or inappropriate for any ages; (v) may not portray us or our products or services, in a false, misleading, derogatory, or otherwise offensive or objectionable manner, or associate us with undesirable products, services, or opinions; and (vi) may not link to any page of the website other than the home page. We may, in our sole discretion, request that you remove any link to the website, and upon receipt of such request, you shall immediately remove such link and cease any linking unless separately and expressly authorized in writing by us to resume linking.</div><div><br></div><div>Any unauthorized use by you of the Sheencare website or any and/or all of our Content automatically terminates the limited licenses set forth in this Section without prejudice to any other remedy provided by applicable law or these Terms and Conditions.</div><div><br></div><div><b>CONTENTS POSTED ON SITE BY USER</b></div><div>You are responsible for any notes, messages, e-mails, billboard postings, photos, drawings, profiles, opinions, ideas, images, videos, audio files or other materials or information posted or transmitted to the Sites (collectively, \"Content\"). Such Content will become the property of <a target=\"_blank\" rel=\"nofollow\" href=\"http://www.sheencare.com\">www.sheencare.com</a> throughout the universe. Sheencare.com shall be entitled to, consistent with our Privacy Policy, use the Content or any of its elements for any type of use forever, including but not limited to promotional and advertising purposes and in any media whether now known or hereafter devised, including the creation of derivative works that may include Content you provide. You agree that any Content you post may be used by <a target=\"_blank\" rel=\"nofollow\" href=\"http://www.sheencare.com\">www.sheencare.com</a>, consistent with our Privacy Policy as mentioned herein, and you are not entitled to any payment or other compensation for such use.</div><div>We do not endorse or control the User Content transmitted or posted on the Sheencare.com website and therefore, we do not guarantee the accuracy, integrity or quality of User Content. You understand that by using this website, you may be exposed to User Content that is offensive, indecent or objectionable to you. Under no circumstances will we be liable in any way for any User Content, including, without limitation, for any errors or omissions in any User Content, or for any loss or damage of any kind incurred by you as a result of the use of any User Content transmitted, uploaded, posted, e-mailed or otherwise made available via the website.</div><div><br></div><div>You acknowledge that we have the right (but not the obligation) in our sole discretion to refuse to post or remove any User Content and we reserve the right to change, condense, or delete any User Content. Without limiting the generality of the foregoing or any other provision of these Terms and Conditions, we have the right to remove any User Content that violates these Terms and Conditions or is otherwise objectionable and we reserve the right to refuse service without prior notice for any users who violate these Terms and Conditions or infringe the rights of others.</div><div><br></div><div><br></div><div><b>YOUR OBLIGATIONS AND RESPONSIBILITIES</b></div><div>In the access or use of the sheencare.com website, you shall comply with these Terms and Conditions and the special warnings or instructions for access or use posted on the website. You shall act always in accordance with the law, custom and in good faith. You may not make any change or alteration to the website or any Content or services that may appear on this website and may not impair in any way the integrity or operation of the website. Without limiting the generality of any other provision of these Terms and Conditions, if you default negligently or wilfully in any of the obligations set forth in these Terms and Conditions, you shall be liable for all the losses and damages that this may cause to Octopus Care, our Affiliates, or partners.&nbsp;</div><div><br></div><div><b>REPRESENTATIONS AND WARRANTIES AND LIMITATION OF LIABILITY</b></div><div>Sheencare.com website is presented “As Is”. We make no representations or warranties of any kind whatsoever, express or implied, in connection with these terms and conditions or the site, including but not limited to warranties of merchantability, non-infringement or fitness for a particular purpose, except to the extent such representations and warranties are not legally excludable.</div><div>You agree that, to the fullest extent permitt